(1, 54, 1, 1, 2, NULL, 'sub-topic', 'Sehat A-Z', 'sehat-a-z', 'new-article', 1, 'new-article', 'article/GzGRBO6ccGgyO72wipbDQVLp7DRqwJINYa6gUthG.png', 1, NULL, '2022-06-15 05:12:40', '2022-09-16 10:01:14', 0),
(5, 68, 1, 3, 1, NULL, 'sub-topic', 'iqra zafar', 'iqra-zafar', 'dsdcdcf', 0, 'health', 'article/TrovicamOoHnvdZ6yds3Z3QQXiG57GOsHSGEokEY.jpg', 0, NULL, '2022-06-23 03:01:34', '2022-07-05 07:35:52', 1),
(6, 68, 1, 3, 1, NULL, 'sub-topic', 'sana', 'sana', 'dcsdvsvsvfvfv', 0, 'health', 'article/v08sm8YpM8n3WHmAVy4qYBUEKK6kEAHOGA6i16ij.jpg', 0, NULL, '2022-06-23 03:19:26', '2022-07-05 07:36:03', 1),
(7, 68, 1, 1, 1, NULL, 'sub-topic', 'The Benefits of Starting Your Day with a Walk', 'the-benefits-of-starting-your-day-with-a-walk', 'When you wake up in the morning, movement might not be your first priority. But starting your day with a walk  whether its around your neighborhood or part of your commute to work or school  can offer your body a number of health benefits.', 0, 'The Benefits of Starting Your Day with a Walk', 'article/S318sqKB15FrUw7KbdriO9oC7U69mB3hUk3RN4Vb.webp', 1, NULL, '2022-06-23 04:15:29', '2022-07-21 08:13:33', 1),
(8, 68, 1, 1, 1, NULL, 'sub-topic', 'Running and jogging - Health Benefits', 'running-and-jogging-health-benefits', 'Jogging or running is a popular form of physical activity. About one in 5 Australians try running (or jogging) at some stage in their life. Running is an appealing exercise because it doesn\'t cost a lot to take part and you can run at any time that suits you.', 0, 'Running, jogging, walking, exercise', 'article/zf1Y8jlTngQJELzazYz6BbJDqnjgoT4ZfxL781mH.jpg', 1, NULL, '2022-06-23 05:28:38', '2022-06-23 10:01:08', 1),
(9, 68, 1, 1, 1, NULL, 'sub-topic', '10 Reasons to Get Up Early  Because Early Rising Isn\'t Just for Birds', '10-reasons-to-get-up-early-because-early-rising-isnt-just-for-birds', 'They say the early bird catches the worm. Gross.\r\n\r\nWorms are hardly an incentive for humans to get up early, unless youre heading out to fish and hoping for some free bait. Still, waking up early does have some perks.', 0, 'Benifits , early- riser', 'article/eorbhjwGVAC49ASW5q3k3CwiYjVGKC3GMrINbWq2.jpg', 1, NULL, '2022-06-23 06:10:04', '2022-07-15 01:26:40', 1),
(10, 68, 1, 1, 1, NULL, 'sub-topic', 'How to Quit Sugar with 8 Easy Tips', 'how-to-quit-sugar-with-8-easy-tips', 'Sugar crashes kill your performance in the gym. But thats only one reason to start pondering how to quit sugar. Too much sugar is scientifically proven to negatively affect your entire body and overall well-being, from your brain to your gut to your joints and beyond.', 0, 'Sweet, sugar', 'article/TRU4e9b1LhEqVuqkHDncyUpV3rb06M1RslyURGPW.jpg', 1, NULL, '2022-06-23 07:12:17', '2022-07-15 01:28:18', 1),
(11, 68, 1, 1, 1, NULL, 'sub-topic', 'Whats the Best Sitting Position for Good Posture?', 'whats-the-best-sitting-position-for-good-posture', 'Youve likely heard that sitting is the new smoking. ResearchTrusted Source suggests sitting for most of your day increases your risk for cardiovascular disease and diabetes. Unfortunately, thats almost all of us.', 0, 'Back pain, posture, sitting', 'article/OIEM7l4O3Ap91aaRW223vPdWzyLPVCfQqLBexnv8.jpg', 1, NULL, '2022-06-23 09:56:47', '2022-07-25 13:56:44', 1),
(12, 68, 1, 12, 1, NULL, 'sub-topic', 'Red food', 'red-food', 'Red food', 0, 'Red food', NULL, 1, NULL, '2022-06-28 07:54:20', '2022-06-28 07:54:20', 1),
(13, NULL, 1, 3, 1, NULL, 'sub-topic', '10 Evidence-Based Health Benefits of Intermittent Fasting', '10-evidence-based-health-benefits-of-intermittent-fasting', 'Intermittent fasting is an eating pattern where you cycle between periods of eating and fasting.\r\n\r\nThere are many different types of intermittent fasting, such as the 16/8 and 5:2 methods.\r\n\r\nNumerous studies show that it can have powerful benefits for your body and brain.\r\n\r\nHere are 10 evidence-based health benefits of intermittent fasting.', 0, 'Fasting', 'article/liDOozA0LASclp4IqefDW8oCjDflFOAATqKFJG3c.jpg', 1, NULL, '2022-07-04 07:20:27', '2022-07-04 08:12:20', 1),
