INSERT INTO `faqs` (`id`, `sequence`, `category_id`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'What services does Meri Sehat provide?', '<p><span id=\"docs-internal-guid-f7f92a75-7fff-9abd-6b8f-82c14a64083f\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Meri Sehat provides health awareness services and softwares that help with improving an individual\'s health</span></span><br></p>', 1, '2022-06-23 02:03:40', '2022-07-25 10:56:14'),
(2, 1, 1, 'How many doctors are a part of Meri Sehat?', '<span id=\"docs-internal-guid-ed3e63b9-7fff-3718-ac09-d2ba0570d416\"><span style=\"font-size: 12pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">We have about a 100 doctors on our panel</span></span>', 1, '2022-07-05 01:31:59', '2022-07-25 10:56:52'),
(3, 1, 2, 'Is my payment secure?', '<p>We use third party vendors for payment processing who make sure your payment is secure according to the latest security standards.<br></p>', 1, '2022-07-22 09:29:40', '2022-07-22 09:48:08'),
(4, 1, 2, 'Do you save credit card information?', '<p>We do not store any information related to credit cards, online wallets, bank accounts and any other financial information.<br></p>', 1, '2022-07-22 09:34:46', '2022-07-22 09:47:36');
