(44, NULL, 1, 12, 'disease', NULL, NULL, 'Angina', 'angina', 'Angina', 0, NULL, NULL, 1, NULL, '2022-07-27 11:26:45', '2022-07-27 11:26:45'),
(45, NULL, 1, 5, 'disease', NULL, NULL, 'Allergies', 'allergies', 'Allergies develop when a persons immune system overreacts to substances that are usually harmless.\r\n\r\nThe first time a person is exposed to an allergen, they do not usually experience a reaction. It often takes time for the immune system to build up a sensitivity to the substance.\r\n\r\nIn time, the immune system learns to recognize and remember the allergen. As it does so, it starts making antibodies to attack it when exposure occurs. This buildup is called sensitizationTrusted Source.\r\n\r\nSome allergies are seasonal. For example, hay fever symptoms can peak between April and May, when the tree and grass pollen count in the air is higher. A person may experience a more severe reaction as the pollen count rises.An allergic reaction occurs when a persons immune system becomes hypersensitive to certain substances, such as foods, pollen, medications, or bee venom.\r\n\r\nA substance that causes an allergic reaction is called an allergen. Many allergens are everyday substances that are harmless to most people. However, anything can be an allergen if the immune system has a specific type of adverse reaction to it.\r\n\r\nOne of the roles of the immune system is to destroy harmful substances in the body. If a person has an allergy to a substance, their immune system will react as though that substance is harmful and will try to destroy it.', 0, 'Allergies', 'page/AlcRTD46eUHaJbDGl3I5kr3qzvNd1PXVWTJUfJxe.jpg', 1, NULL, '2022-07-27 11:27:52', '2022-07-27 11:42:45'),
(46, NULL, 1, NULL, 'page', NULL, NULL, 'Consult Now', 'consult-now', 'Consultation', 0, 'consult, doctor, consultation', NULL, 1, NULL, '2022-07-28 08:22:32', '2022-07-28 08:23:30'),
