(3, 1, 2, 'Complete Blood Count', 'Complete Blood Count', 'This test, also known as a CBC, is the most common blood test performed. It measures the types and numbers of cells in the blood, including red and white blood cells and platelets. This test is used to determine general health status, screen for disorders and evaluate nutritional status. It can help evaluate symptoms such as weakness, fatigue and bruising, and can help diagnose conditions such as anemia, leukemia, malaria and infection.', 1, '2022-07-18 12:32:55', '2022-07-18 12:32:55'),
(4, 1, 2, 'Basic Metabolic Panel', 'Basic Metabolic Panel', 'This test measures glucose, sodium, potassium, calcium, chloride, carbon dioxide, blood urea nitrogen and creatinine which can help determine blood sugar level, electrolyte and fluid balance as well as kidney function. The Basic Metabolic Panel can help your doctor monitor the effects of medications you are taking, such as high blood pressure medicines, can help diagnose certain conditions, or can be part of a routine health screening. You may need to fast for up to 12 hours before this test.', 1, '2022-07-18 12:32:55', '2022-07-18 12:32:55');
