INSERT INTO `reference_widgets` (`id`, `widget_id`, `reference_id`, `ad_window_id`, `reference_type`, `heading`, `description`, `redirect_url`, `json_param`, `sequence`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 7, 1, NULL, 'article', 'Sweet Dreams from Healthline Sleep: A Letter from the Editor', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; font-size: 18px; line-height: 26px; padding-top: 0px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Ive always said that sleeping is the thing Im best at. If only I could figure out how to monetize this and make it my job! Id joke.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">I never thought much about things like sleep hygiene or whether I was getting too much blue light from screen time before bed. I was one of those people who could fall (and stay) asleep pretty easily. In fact, if I had any sleep issues at all, it was that left to my own devices, I could sleep a bit&nbsp;<em style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\">too</em>&nbsp;much.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">I was made for leisurely wake-ups and breakfast in bed. Its amazing to me that I was ever able to dress and feed myself, do a 45-minute commute, and still make it into the office by 9 a.m. (OK, 9:30 a.m.)</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Then I became a parent.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Everyone tells you how sleep is the first thing you lose when you have a baby. I cant tell you how many times I heard get your sleep in now, as if it were possible to bank all of those hours and use them as credit in the months to come. It wasnt that I didnt believe any of those other well-meaning parents, but like most experiences in parenting, you dont really get it until youre in it.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">I didnt know that the night before I went into labor was the last time Id sleep a full, uninterrupted 8 hours for many, many months to come. I couldnt imagine the type of bone-deep fatigue that would come with waking every few hours (or some nights, every 45 minutes) for weeks and months on end.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">As new parents, my husband and I had to learn how to function on a sleep deficit. I kept reminding myself that it would get better, this part was only temporary. And things did get better  babies are amazing that way  but it still felt like we were rolling the dice every night.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">My experience may be specific to the challenges of new parenthood, but research shows that a surprising number of Americans arent getting enough sleep.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">According to the U.S. Department of Health and Human Services, about&nbsp;<hl-trusted-source source=\"Department of Health and Human Services\" rationale=\"Governmental authority\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a rel=\"noopener noreferrer\" href=\"https://health.gov/healthypeople/objectives-and-data/browse-objectives/sleep/increase-proportion-adults-who-get-enough-sleep-sh-03\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">67% of adults<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>&nbsp;and only&nbsp;<hl-trusted-source source=\"Department of Health and Human Services\" rationale=\"Governmental authority\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a rel=\"noopener noreferrer\" href=\"https://health.gov/healthypeople/objectives-and-data/browse-objectives/sleep/increase-proportion-high-school-students-who-get-enough-sleep-sh-04\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">22% of high-school-aged teens<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>&nbsp;get sufficient sleep each night.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">In a survey of Healthline readers, 3 out of 5 reported that they get only light sleep, and more than half experience pain or discomfort that interferes with their ability to fall or stay asleep.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">My fellow tired folks,&nbsp;<a rel=\"noreferrer noopener\" href=\"https://www.healthline.com/sleep\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">Healthline Sleep</a>&nbsp;was made for us.</p>', NULL, NULL, 30, 1, '2022-06-15 05:41:31', '2022-07-30 12:36:58', NULL),
