(9, 7, 2, NULL, 'article', 'Indoor and Outdoor Allergies', 'Both indoor and outdoor activities can cause swelling and sinus pain in addition to watery eyes, nasal congestion, and sneezing. Airborne allergens can cause hay fever or rose fever, which are seasonal or constant persistent allergies.\r\n\r\nPeople will allergies usually have more than one type of allergy and the most common are indoor/outdoor allergies. The triggers are grass pollen, tree pollen, weed pollen, mould spores, cockroaches, dust mites, cat or dog dander, and rodent urine (not common in Pakistan).', NULL, NULL, 10, 1, '2022-06-16 08:02:27', '2022-07-30 11:36:58', NULL),
