(35, 7, 4, NULL, 'article', 'Characteristics of post-traumatic growth', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\">Post-traumatic growth (PTG) is where someone has been affected by&nbsp;<a href=\"https://www.healthline.com/health/post-traumatic-stress-disorder\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">PTSD</a>&nbsp;and finds a way to take new meaning from their experiences in order to live their lives in a different way than prior to the trauma, explains&nbsp;<a href=\"http://www.goodthinkingpsychology.co.uk/\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">Dr. Marianne Trent</a>, a clinical psychologist and owner of Good Thinking Psychological Services.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\"><hl-trusted-source source=\"PubMed Central\" rationale=\"Highly respected database from the National Institutes of Health\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://pubmed.ncbi.nlm.nih.gov/30268956/\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">One study<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>&nbsp;suggests that nearly 50 percent of trauma survivors experience post-traumatic growth after a traumatic event.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\">Examples of areas for growth include personal strength, appreciation for life, new possibilities in life, spiritual change, and relationships with others, Trent says. Examples of PTG can be vast, ranging from writing books, finding God, starting charities, and many more. </p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\">According to environmental psychologist and well-being consultant&nbsp;<a href=\"https://leechambers.org/\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">Lee Chambers</a>, PTG can present itself in all sorts of ways, like uncovering latent talent and ability, finding the confidence to face new challenges, and discovering a feeling of strength.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\">It tends to generate a level of&nbsp;<a href=\"https://www.healthline.com/health/mind-body/mindfulness-activities\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">mindfulness</a>&nbsp;and gratitude for life and the present moment and a focus on those relationships that should be prioritized, usually those that the individual feels were there for them in difficult times, explains Chambers.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px;\">Other often-reported outcomes are a desire to help others and give back, appreciation for life, more self-awareness and more compassion for others.</p>', NULL, NULL, 1, 1, '2022-06-21 09:52:59', '2022-07-15 04:37:14', NULL),
(36, 7, 4, NULL, 'article', 'PTG and the pandemic', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">While post-traumatic growth is nothing new, you may hear more about it as we exit the pandemic.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">A recent&nbsp;<a href=\"https://www.cambridge.org/core/journals/bjpsych-open/article/posttraumatic-growth-during-the-covid19-pandemic-in-carers-of-children-in-portugal-and-the-uk-crosssectional-online-survey/66826594FC933FF4DE40E9ABDB061A02\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">study</a>&nbsp;published in the Journal of Psychiatry discovered that 88 percent of the surveys 385 respondents said that theyd experienced positive effects from challenging pandemic circumstances, such as homeschooling, loss of income, and health concerns.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">In particular, respondents noted positive improvements in family relationships and reported a greater appreciation for life. Others said that they had experienced spiritual growth because of pandemic trauma and reported improved mental health.</p>', NULL, NULL, 2, 1, '2022-06-21 09:54:35', '2022-06-21 09:55:04', NULL),
(37, 7, 4, NULL, 'article', 'Different responses to trauma', '<p>Post-traumatic growth begs an obvious question: Why do some people grow from trauma while others are crushed by it?</p>\r\n<p>Trent and Chambers say the following factors play a major role:</p>\r\n<ul>\r\n<li>a strong support system</li>\r\n<li>personality traits like&nbsp;<a href=\"https://www.healthline.com/health/what-is-an-extrovert\">extraversion</a>&nbsp;and openness</li>\r\n<li>the ability to integrate the traumatic experience</li>\r\n<li>developing new belief systems after the traumatic experience</li>\r\n</ul>\r\n<p>Being able to find the benefit from traumatic events is impacted by so many variables, says Chambers.</p>\r\n<h3>Support</h3>\r\n<p>One major factor is the strength of your support system. Those who have a strong network of supportive family and friends and the resources to seek mental health care are more likely to bounce back, studies show.</p>\r\n<h3>Personality</h3>\r\n<p>Psychology also plays a role.</p>\r\n<p>The two psychological traits which indicate a higher likelihood of experiencing post-traumatic growth are openness to experience and extraversion, Chambers explains.</p>\r\n<p>This would likely be because openness allows the reconsideration of belief systems, and extroverts are more likely to initiate a response and actively seek social connection. Having positive personality traits such as optimism and future-focus can also play a part, allowing us to see the potential upside and utilize it.</p>\r\n<h3>Integrating the experience</h3>\r\n<p>Trent says that PTG occurs when the individual who experienced trauma is able to integrate their experience into their lives.</p>\r\n<p>In doing so, this leads to the development of new belief systems, she says.</p>\r\n<p>Otherwise, individuals may remain in the traumatized state.</p>\r\n<p>In my specialist work with people in trauma therapy, it seems that those who are less able to assimilate their experiences into their lives are more likely to get stuck, says Trent.</p>\r\n<h3>PTG or resilience?</h3>\r\n<p>Trent points out that you technically have to experience post-traumatic stress before you can experience post-traumatic growth.</p>\r\n<p>In order to be classed as PTG, the person would have had to have experienced symptoms of PTSD [first], she explains. Without these symptoms, any growth would be attributed to resilience rather than growth specifically due to the trauma.</p>', NULL, NULL, 3, 1, '2022-06-21 09:56:40', '2022-07-07 11:15:25', NULL),
