(43, 8, 1, NULL, 'page', 'Blood Pressure Monitoring Available Now! Approved and recommended by doctors.', '<p>Our HealthCheck technology has been through a series of global clinical trials and is currently in advanced stages of FDA approval.&nbsp;</p><p>We developed it so that families everywhere could stay healthy and better informed - Night or Day!&nbsp;</p>', '/start-vital-scan', NULL, 140, 1, '2022-06-22 11:07:10', '2022-07-22 11:22:55', NULL),
(44, 7, 7, NULL, 'article', 'Boost your energy', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Starting out your day with a walk may give you more energy throughout the day. If you walk outdoors, thats especially true.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Studies &nbsp;show that adults who walked for 20 minutes outdoors experienced more vitality and energy than those who walked for 20 minutes indoors.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">A small study found that 10 minutes of stair walking was more energizing than a cup of coffee for 18 women who felt sleep-deprived.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The next time you need a morning energy boost or feel tired when you wake up, you may want to try a walk.</p>', NULL, NULL, 10, 1, '2022-06-23 04:16:29', '2022-07-21 07:36:01', NULL),
(45, 7, 7, NULL, 'article', 'Improve your mood', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">There are physiological benefits to walking in the morning, too.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">A walk may help:</p><ul style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; list-style-image: url(&quot;data:image/svg+xml,%3Csvg width=\'10\' height=\'10\' xmlns=\'http://www.w3.org/2000/svg\'%3E%3Ccircle cx=\'5\' cy=\'5\' r=\'2.5\' fill=\'%23EC1C82\'/%3E%3C/svg%3E&quot;); color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\"><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">improve self-esteem</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">boost mood</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">reduce stress</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">reduce anxiety</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">reduce fatigue</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\">ease depression symptoms or reduce your risk for depression</li></ul><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">For best results, try walking for 20 to 30 minutes at least 5 days a week.</p>', NULL, NULL, 50, 1, '2022-06-23 04:17:20', '2022-07-21 07:36:01', NULL),
(46, 7, 7, NULL, 'article', 'Complete your physical activity for the day', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">One benefit of walking in the morning is that youll complete your physical activity for the day  before any other family, work, or school obligations derail you.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The&nbsp;<font color=\"#02838d\"><span style=\"box-sizing: inherit; cursor: pointer; border-color: currentcolor;\">Physical Activity Guidelines for Americans</span></font>&nbsp;recommends that healthy adults should complete at least 150 to 300 minutes of moderate-intensity exercise per week.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Try to complete a 30-minute walk 5 mornings a week to meet these requirements.</p>', NULL, NULL, 40, 1, '2022-06-23 04:18:08', '2022-07-21 07:36:01', NULL),
(47, 7, 7, NULL, 'article', 'It may help you lose weight', '<p><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">Walking in the morning may help you meet your weight loss goals. Walking at a moderate pace for 30 minutes can burn up to&nbsp;</span><a href=\"https://www.mayoclinic.org/healthy-lifestyle/weight-loss/expert-answers/walking/faq-20058345\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">150 calories</a><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\">. Combined with a healthy diet and strength training, you may find you lose weight.</span><br></p>', NULL, NULL, 30, 1, '2022-06-23 04:33:28', '2022-07-21 07:36:01', NULL),
(48, 7, 7, NULL, 'article', 'Prevent or manage health conditions', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Walking can offer numerous benefits for your health, including boosting your immunity, as well as preventing and helping you manage various health conditions.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Studies show that walking for 30 minutes per day can reduce your risk for heart disease by 19 percent. If you live with diabetes, walking may also help lower your blood sugar levels.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">It can even help increase your life span and reduce your risk for cardiovascular disease and certain cancers.</p>', NULL, NULL, 20, 1, '2022-06-23 04:34:30', '2022-07-21 07:36:01', NULL),
(50, 11, 7, NULL, 'page', NULL, NULL, NULL, NULL, 1, 1, '2022-06-23 05:23:12', '2022-06-23 05:23:12', NULL),
