(53, 7, 8, NULL, 'article', 'Running benefits', '<p><span style=\"color: rgb(34, 34, 34); font-family: VIC-Regular, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 16px; letter-spacing: normal;\">The difference between running and jogging is intensity. Running is faster, uses more kilojoules and demands more effort from the heart, lungs and muscles than jogging. Running requires a higher level of overall fitness than jogging.</span><br></p>', NULL, NULL, 3, 1, '2022-06-23 05:45:38', '2022-06-23 10:02:50', NULL),
(54, 12, 8, NULL, 'article', NULL, NULL, NULL, NULL, 3, 0, '2022-06-23 05:45:38', '2022-06-23 05:51:13', NULL),
(55, 7, 8, NULL, 'article', 'Running and jogging for beginners', '<ul>\r\n<li>See your doctor for a check-up before you start a running program. This is especially important if you are over 40 years, are&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/obesity\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/obesity\">overweight</a>, have a chronic illness or haven\'t exercised in a long time.</li>\r\n<li>Pre-exercise screening is used to identify people with medical conditions that may put them at a higher risk of experiencing a health problem during physical activity. It is a filter or safety net to help decide if the potential benefits of exercise outweigh the risks for you. Print a copy of the&nbsp;<a href=\"https://ausactive.org.au/policies-guidelines/adult-pre-exercise-screening-system/\" data-print-url=\"https://ausactive.org.au/policies-guidelines/adult-pre-exercise-screening-system/\">pre-exercise screening&nbsp;tool</a>&nbsp;and discuss it with your doctor or exercise professional.</li>\r\n</ul>', NULL, NULL, 5, 1, '2022-06-23 05:52:05', '2022-07-07 11:13:34', NULL),
(56, 7, 10, NULL, 'article', 'Tips', '<p>Congrats on making the big decision to cut refined sugar from your diet! It may be a slow and tough process, but just wait until you feel how your body functions without all that added sugar!</p>\r\n<h4>1. Dont quit cold turkey</h4>\r\n<p>Some will advise you to stop eating sugar all at once  not us! In order to make sustainable health changes, its best to implement slow but steady adjustments. If you consume a lot of added sugar, stopping all at once will produce a lot of unwanted withdrawal symptoms and leave you feeling extra discouraged. Slowly wean off of sugar, starting with the easiest to the toughest items to eliminate. Maybe try skipping sugar in your coffee first. Then work your way onto deserts. Just dont do it all at once!</p>\r\n<h4>2. Avoid blood sugar crashes</h4>\r\n<p>Low blood sugar equals some serious sugar cravings. Because of that, its important to help stabilize blood sugar crashes by eating regular meals. When you skip a meal, your blood sugar drops, causing your body to crave sugar in an effort to raise blood sugar levels. A quick boost in sugar prompts a rush of insulin to the body, which drops your blood sugar low once again. Its a vicious cycle.</p>\r\n<h4>3. Stay hydrated</h4>\r\n<p>Around here, were big fans of hydration. Its essential to help keep your body and its organs functioning properly. In fact, hydration even plays a role in your hunger levels as well as cravings.&nbsp;Dehydration can prevent your body from properly metabolizing glycogen (the converted form of glucose) for energy. Without enough glycogen, your body craves sugar to get the energy it needs.</p>\r\n<p>So when youre craving sugar (and ideally way before), reach for a glass of water. For added hydration benefits, use a packet of&nbsp;<a href=\"https://livpur.com/products/energy\">LivPr Hydrate</a>&nbsp;with your water.* Why?&nbsp;</p>\r\n<p>Hydration isnt just about drinking water; its about replenishing your cells with essential nutrients and maintaining balance of all the important electrolytes.</p>\r\n<p>You dont just need to drink&nbsp;<em>more&nbsp;</em>water. You need to drink smarter!</p>\r\n<p>*LivPr Hydrate does contain a small amount of dextrose, the most absorbable form of sugar. Its naturally occurring and found in our own bodies. Not all sugar is bad  this one helps you absorb the nutrients found in LivPr Hydrate into your bloodstream.</p>\r\n<h4>4. Prioritize sleep</h4>\r\n<p>If youve ever felt hungrier or had intense cravings for high-calorie foods the day after a rough night of sleep, youre not alone. In fact, research shows that&nbsp;<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3763921/\">sleep deprivation affects food cravings</a>. When you dont get sufficient sleep, your hormones suffer. Ghrelin, the hunger hormone, increases. Leptin, the appetite-suppressing hormone, decreases. And cortisol, your stress hormone, may even increase, causing a rise in your cravings and appetite. Getting those seven to nine hours of sleep at night may help keep stress at bay, improve your productivity and concentration, AND reduce sugar cravings.</p>\r\n<h4>5. Exercise!</h4>\r\n<p>Research shows that short workout sessions can help reduce sugar cravings, even if its just a&nbsp;<a href=\"https://journals.plos.org/plosone/article?id=10.1371/journal.pone.0119278\">15-minute brisk walk</a>. So if you needed one more reason to get up and get moving, heres one! Exercising, including a simple walk, also helps lower cortisol (or stress) levels that can contribute to your desire for sugar. Basically, exercising is a great idea  cutting sugar or not.</p>\r\n<h4>6. Reframe your thinking</h4>\r\n<p>We often see sugar as a treat, so without it, it feels like punishment. Whenever youre giving up a food, its important to focus on what you still can have instead of what you cant. Otherwise you may grow resentful and frustrated. Try internal dialogue like, Im avoiding sugar to boost my health and wellbeing. I dont want to put that into my body, but Im going to have an apple with creamy almond butter instead!</p>\r\n<h4>7. Fill up on the good stuff</h4>\r\n<p>Skip all of the refined carbs and nutrient-void junk foods! Loading your meals up with healthy fats and lean proteins will not only help keep your blood sugar balanced, but itll also keep you feeling full! Both fats (like nuts, avocados, and olive oil) and protein (chicken, turkey, eggs, and legumes) contribute to satiety. When youre full, youre less likely to feel  or give into  those pesky sugar cravings.</p>\r\n<h4>8. Find healthier alternatives</h4>\r\n<p>Quitting sugar doesnt have to mean giving up sweet flavors. Fruit is a part of a healthy, well-balanced diet. Natural sweeteners like stevia can be too! Stevia is plant-derived with almost no carbs or calories. Its the sweetener we use here at LivPr for&nbsp;<a href=\"https://livpur.com/products/plant-protein\">Plant Protein</a>,&nbsp;<a href=\"https://livpur.com/products/recovery\">Recovery</a>, and&nbsp;<a href=\"https://livpur.com/products/energy\">Energy</a>. Stevia sweetens so well that some even say LivPr tastes like candy!</p>\r\n<p>So if youre struggling to kick sugar, try LivPr in place of other energy drinks, sports drinks, juices, or sodas. Youll curb your sweet tooth and reap tremendous health benefits at the same time. Its a win-win.</p>', NULL, NULL, 10, 1, '2022-06-23 07:12:17', '2022-07-14 06:40:05', NULL),
