(59, 7, 8, 1, 'article', 'Goal setting for running and jogging', '<p style=\"max-width: 90%; color: rgb(34, 34, 34); font-family: VIC-Regular, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 16px; letter-spacing: normal;\">Think about what you want to achieve from running or jogging. Issues to consider may include:</p><ul style=\"padding-left: 1.1rem; margin: 1rem 0px 1.5rem; max-width: 100%; color: rgb(34, 34, 34); font-family: VIC-Regular, Arial, Helvetica, &quot;sans-serif&quot;; letter-spacing: normal;\"><li style=\"padding-left: 0.25rem;\"><span style=\"font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 1rem; line-height: 1.5em;\">Getting fit</span>&nbsp; if you\'re a beginner, you should start with&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/walking-for-good-health\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/walking-for-good-health\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">brisk walking</span></span></a>, progress to jogging and work up to running. This should take a few months.</li><li style=\"padding-left: 0.25rem; margin-top: 0.5rem;\"><span style=\"font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 1rem; line-height: 1.5em;\">General fitness</span>&nbsp; mix your running with other forms of exercise (such as&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/swimming-health-benefits\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/swimming-health-benefits\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">swimming</span></span></a>&nbsp;or team sports) to maximise your overall fitness.</li><li style=\"padding-left: 0.25rem; margin-top: 0.5rem;\"><a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/weight-loss-a-healthy-approach\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/weight-loss-a-healthy-approach\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">Weight loss</span></span></a>&nbsp; adjust your diet to include plenty of fresh&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/fruit-and-vegetables\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/fruit-and-vegetables\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">fruits and vegetables</span></span></a>,&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/Meat-and-poultry\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/Meat-and-poultry\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">lean meats</span></span></a>,&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/cereals-and-wholegrain-foods\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/cereals-and-wholegrain-foods\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">wholegrain cereals</span></span></a>&nbsp;and low-fat&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/Dairy-and-dairy-alternatives\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/Dairy-and-dairy-alternatives\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">dairy products</span></span></a>. Cut back on&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/fats-and-oils\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/fats-and-oils\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">dietary fats</span></span></a>, takeaway foods,&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/soft-drinks-juice-and-sweet-drinks-limit-intake\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/soft-drinks-juice-and-sweet-drinks-limit-intake\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">soft drinks</span></span></a>&nbsp;and&nbsp;<a href=\"https://www.betterhealth.vic.gov.au/health/healthyliving/sugar\" data-print-url=\"http://www.betterhealth.vic.gov.au/health/healthyliving/sugar\" class=\"rpl-link rpl-link--nuxt rpl-text-link\" style=\"text-decoration-line: underline; color: rgb(0, 128, 85); font-size: 1rem; line-height: 1.375rem; font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;;\"><span class=\"rpl-link__inner\" style=\"display: inline;\"><span class=\"rpl-text-label\" style=\"text-decoration-line: underline; font-size: 1rem; line-height: 1.375rem;\">sugar</span></span></a>.</li><li style=\"padding-left: 0.25rem; margin-top: 0.5rem;\"><span style=\"font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 1rem; line-height: 1.5em;\">Companionship</span>&nbsp; you could run with a friend or join a local running club.</li><li style=\"padding-left: 0.25rem; margin-top: 0.5rem;\"><span style=\"font-family: VIC-SemiBold, Arial, Helvetica, &quot;sans-serif&quot;; font-size: 1rem; line-height: 1.5em;\">Competition</span>&nbsp; running clubs may offer competitive events. Most clubs have sessions designed for beginners through to advanced runners. You can pit your running skills against others in fun runs or marathons. Many community-based running events cater for people of all ages and abilities. Join a local orienteering club to combine running with the challenge of navigating through various environments.</li></ul>', NULL, NULL, 6, 0, '2022-06-23 10:01:08', '2022-07-04 09:31:27', NULL),
(60, 7, 9, NULL, 'article', 'The Science Behind Morning Wakefulness and Nighttime Sleepiness', '<p>Our bodies are designed to produce the&nbsp;<a href=\"https://amerisleep.com/blog/melatonin-for-sleep/\">sleep-inducing hormone melatonin</a>&nbsp;after dark. The sleep-wake cycle in our body is regulated by our circadian rhythms, our bodys internal clock, which works with the light and darkness around us. When our retina perceives light, it signals the Suprachiasmatic Nucleus (our bodys biological master clock) to suppress melatonin production, causing wakefulness. We are naturally attuned to being more responsive and alert during morning hours and sluggish and sleepy at night.</p>\r\n<p>Before you get into the habit of waking up early, you should know the benefits that come along with it. If you are already an early riser, you know what the mornings bring, apart from the beautiful sunrise. However, for those who are not early risers, heres a list of the many advantages.</p>', NULL, NULL, 1, 1, '2022-06-23 10:03:50', '2022-07-05 07:40:35', NULL),
(61, 7, 9, NULL, 'article', 'Follow Proper Sleep Hygiene', '<p>Develop a bedtime routine that tells your body its time to sleep. For example, take a hot shower, read your favorite book, or reminisce about the positives in your day. All of these help you unwind and prepare your body to sleep. Taking a warm water shower physiologically prepares your body for sleep. The warm water raises your body temperature and then as you step out of the shower, it drops immediately. When you sleep, your body experiences a drop in temperature, so a warm bath facilitates this process of sleep.</p>\r\n<p>Blue lights from the television or your electronic devices can suppress melatonin production. Insufficient or delayed production of this sleep-inducing hormone may negatively affect your sleep quality. To be consistent about waking up early, you need to sleep early.</p>\r\n<p>Staying away from blue lights at least an hour before bedtime helps you achieve the goal of sleeping early. This practice also prevents you from scrolling through your phone, tablet, or binge-watching your favorite series. All these activities may further stimulate your brain, delaying sleep.</p>', NULL, NULL, 2, 1, '2022-06-23 10:06:46', '2022-08-02 06:53:18', '2022-08-02 06:53:18'),
(62, 7, 11, NULL, 'article', 'Why your posture matters?', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Youve likely heard that sitting is the new smoking.&nbsp;<hl-trusted-source source=\"AHA/ASA Journals\" rationale=\"Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"http://circ.ahajournals.org/content/134/13/e262\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">Research<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>&nbsp;suggests sitting for most of your day increases your risk for cardiovascular disease and diabetes. Unfortunately, thats almost all of us.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">As technology keeps us strapped to computers and electronic devices, more of us are sitting for longer periods of time than ever before. And our health is suffering the consequences.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">While you may not be able to swap your desk job for one that requires you to walk or stay active all day, there is one thing you can do to improve your health right now: Sit correctly.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">To avoid the effects of a lifetime of sitting, read on to learn how to find and maintain good posture. Plus, find out which gadgets really are worth the money if youre trying to protect your bones for the future.</p>', NULL, NULL, 1, 1, '2022-06-23 10:09:07', '2022-06-23 10:09:53', NULL),
(63, 7, 11, NULL, 'article', 'Whats the correct position?', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Finding the correct position for sitting requires you to follow a few simple steps. Each time you sit down, quickly repeat these steps to help your body settle into its best position.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">First, start by sitting at the end of your chair. Roll your shoulders and neck forward into a full slouching position. Then, slowly pull your head and shoulders up into a tall sitting position. Push your lower back forward and accentuate the curves of your spine. This will likely feel forced and uncomfortable, but hold for several seconds.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Release this sitting position slightly, and youre sitting in a good posture position. Scoot yourself back in the chair until your back is against the chair and your hips are in the bend of the chair.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Now that you have your back in a good position, you need to address other factors that influence your posture, from where to put your feet to how far away your screen should be.</p>', NULL, NULL, 2, 1, '2022-06-23 10:09:25', '2022-06-23 10:10:31', NULL),
