(82, 7, 9, NULL, 'page', 'Sleep Style Quiz: What Type of Sleeper Are You?', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\"><b><u>MY HEADING</u></b></p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Weve all got that one friend who can nod off anywhere  the subway, the dental chair, you name it. And you likely know at least one person who cant rest without their perfectly firm pillow and white noise machine cranked full-blast. We all have a sleep style<span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">.</span></p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Our sleep styles are determined by our preferred sleep schedule and internal clock, how our energy levels fluctuate throughout the day, our personality, and even our feelings about bedtime in general. Hey, some of us still fight lights-out time, even though weve been adulting for years. And theres nothing wrong with that.&nbsp;</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">No one style is better or worse than another. But knowing your sleep MO can help you fine-tune your Zzzs needs. Take our sleep quiz to discover your sleeper type and read a few tips for getting those quality 7-plus hours for optimal health and well-being.</p>', '#', NULL, 90, 1, '2022-06-28 07:39:30', '2022-07-01 06:45:51', NULL),
