(85, 7, 11, NULL, 'page', 'Asthma is a common lung condition that causes occasional breathing difficulties.', '<p>It affects people of all ages and often starts in childhood, although it can also develop for the first time in adults.\r\n</p><p>\r\nThere\'s currently no cure, but there are simple treatments that can help keep the symptoms under control so it does not have a big impact on your life.</p>', NULL, NULL, 10, 1, '2022-06-29 03:14:28', '2022-07-04 04:09:32', NULL),
