(88, 7, 13, NULL, 'page', 'Key points', '<ol><li>Acne is a common skin condition that affects 9.4% of the worlds population and 5% of Pakistans population. </li><li>\r\nAcne has two subtypes: inflammatory and noninflammatory. Identifying the type of acne is essential for successful treatment. </li><li>\r\nLocal symptoms of acne include pain, tenderness, and erythema.  In rare cases, acne may present as highly inflamed cysts and abscesses with systemic symptoms including fever, joint pain and general malaise.\r\nCurrently, the first line of treatment recommended for most acne patients is a combination of topical retinoids and antibacterial therapy \r\n</li></ol>', NULL, NULL, 20, 1, '2022-07-02 07:17:22', '2022-07-14 09:05:44', NULL),
(89, 7, 13, NULL, 'page', 'Overview', '<p>The skin consists of tiny holes (pores), that may become blocked by oil, dirt, bacteria, and dead skin cells. When this happens, you may develop non-inflammatory nodules, pustules and inflammatory papules (open or closed) also known as pimples, zits, or blemishes. If you struggle with repeated outbreaks of pimples on your skin, you may have acne.</p>\r\n<p>Acne typically affects the face, upper part of the chest and back and is a common skin condition that causes pimples According to recent research, acne affects 9.4% of the worlds population and is the 8<sup>th</sup> most prevalent disease in the world <u><a href=\"https://pubmed.ncbi.nlm.nih.gov/25597339/#:~:text=Acne%20is%20estimated%20to%20affect,severe%20forms%20of%20the%20disease\">[1]</a></u>. According to the American Academy of Dermatology, Acne is the most common skin condition in the United States and affects 50 million Americans annually <u><a href=\"https://www.aad.org/media/stats-numbers#:~:text=Acne%20is%20the%20most%20common,to%2050%20million%20Americans%20annually.&amp;text=Acne%20usually%20begins%20in%20puberty,experience%20at%20least%20minor%20acne.\">[2]</a></u>. In Pakistan, approximately 5% of the population is affected by acne <u><a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC6823076/\">[3]</a></u>. While, Acne does not have any adverse health risks associated with it, it can be painful and may cause scarring. Acne and acne scars also contribute to emotional distress and can affect self-confidence in the long run, causing permanent physical and mental scarring.</p>\r\n<p>During adolescence, Acne more commonly affects males than females, and the reverse is seen in adulthood Neonatal acne is a condition affecting newborns in the first few weeks of life, possible due to the influence of maternal hormones. The lesions seen in neonatal acne often spontaneously and a few cases require therapy with topical retinoids.</p>\r\n<p>Adolescent acne affects many adolescents and young adults. It generally begins at the onset of puberty and affects 85% of people between the ages of 12 and 24 years. However, acne is not limited to adolescence and can occur at any stage of life for example. it can affect people in their 30s and 40s. 12% to 15% of women suffer from adult acne, and by age 45, 5% of both men and women may be affected <u><a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4769025/\">[4]</a></u>.</p>', NULL, NULL, 30, 1, '2022-07-02 07:21:35', '2022-07-14 09:05:44', NULL),
(90, 7, 13, NULL, 'page', 'What are the different types of acne?', '<p>The term breakout is often used to describe all forms of acne, however, this is an incorrect use of the word as not all types of acne spread across the skin. Identifying the type of acne is essential for successful treatment. Acne may be noninflammatory or inflammatory with the subtypes:</p>\r\n<ul>\r\n<li>Blackheads</li>\r\n<li>Whiteheads</li>\r\n<li>Papules</li>\r\n<li>Pustules</li>\r\n<li>Nodules</li>\r\n<li>Cysts</li>\r\n</ul>\r\n<p><strong>Noninflammatory acne </strong></p>\r\n<p>Non-inflammatory acne includes blackheads and whiteheads that dont cause swelling and can be treated with over the counter (OTC) treatments. Salicyclic acid works well in treating non inflammatory acne due to its ability to remove dead skin cells during exfoliation.</p>\r\n<p><strong>Blackheads </strong></p>\r\n<p>Blackheads occur when a combination of sebum and dead skin cells clog pores. However, despite the pore being clogged, the top of the pore stays open, resulting in the black color seen on the surface.</p>\r\n<p><strong>Whiteheads </strong></p>\r\n<p>Whiteheads are also caused by clogged pores. But unlike blackheads, the top of the pore is closed, giving the appearance of a small bump protruding from the skin. Whiteheads are more difficult to treat as the pores are already closed.</p>\r\n<p><strong>Inflammatory acne </strong></p>\r\n<p>Inflammatory acne is characterized by pimples that are red and swollen. Bacteria play an essential role in clogging up pores and can trigger infection deep within the skins surface. This results in painful acne spots. Sub types of inflammatory acne include papules, pustules, nodules, and cysts.</p>\r\n<p><strong>Papules </strong></p>\r\n<p>Papules occur when the walls surrounding the pores break down because of severe inflammation, resulting in hard, clogged pores that are also tender to touch. Generally, the skin around the pores is pink.</p>\r\n<p><strong>Pustules </strong></p>\r\n<p>Though similar in appearance, pustules are filled with pus. The bumps are red in color and often have yellow or whiteheads on top.</p>\r\n<p><strong>Nodules </strong></p>\r\n<p><span style=\"letter-spacing: 0.2px;\">Nodules can develop when irritation causes the swollen pores to become larger. Unlike pustules and papules, the nodules are deep underneath the skin.</span><br></p>\r\n<p><strong>Cysts </strong></p>\r\n<p>Cysts are painful pus-filled lumps under the skin that occur when the pores are clogged by a combination of bacteria, sebum, and dead skin cells. The clogs are deeper within the skin, below the surface than nodules. Cysts are the largest form of acne and appear as large red or white bumps that are often painful to touch. The acne is a form of severe infection that is also most likely to scar.</p>', NULL, NULL, 40, 1, '2022-07-02 07:25:59', '2022-07-14 09:05:44', NULL),
(91, 8, 11, NULL, 'page', NULL, NULL, NULL, NULL, 20, 1, '2022-07-02 07:28:00', '2022-07-02 07:28:00', NULL),
(92, 7, 13, NULL, 'page', 'Causes', '<p>Acne develops when the pores of the skin become clogged with oil, dead skin cells or bacteria. Underneath each pore is a follicle which is made up of a hair and oil gland. The oil gland releases oil that travels to the hair and out of the pore onto your skin. The purpose of this oil is to keep your skin soft and lubricated. Acne is triggered if the follicles produce excessive oil leading to the accumulation of dead skin cells and buildup of bacteria in the pore. A pimple develops when bacteria grow in the clogged pore and there is no escape route for the oil.</p><p><span style=\"letter-spacing: 0.2px;\">Studies have further shown that the underlying causes of acne are:</span><br></p>\r\n<h2>This is Heading 02</h2>\r\n<h3>This is Heading 03</h3>\r\n<h4>This is Heading 04</h4>\r\n<h5>This is Heading 05</h5>\r\n<h6>This is Heading 06</h6>\r\n<ul>\r\n<li>Genetic tendency</li>\r\n<li>Cosmetics and hair products that may worsen acne</li>\r\n<li>Medications e.g. steroids, lithium, iodides and antiepileptics can also promote the development of acne.</li>\r\n<li>Certain medical conditions such as congenital adrenal hyperplasia, polycystic ovarian syndrome and endocrine disorders can lead to an increased production of androgens, which can trigger development of acne.</li>\r\n<li>Pregnancy</li>\r\n<li>Mechanical trauma with headbands, underwire bras, backpacks, and shoulder pads.</li>\r\n<li>Excessive exposure to sunlight or ultraviolet rays can also cause acne flares.</li>\r\n<li>Sometimes nonprescription acne lotions, cleansers and other skin products can cause redness, irritation, and itchiness where the product is applied. Seek emergency medical help if there are signs of faintness, difficulty breathing, tightness of the throat or swelling of the face, lips or tongue.</li>\r\n</ul>', NULL, NULL, 50, 1, '2022-07-02 07:29:07', '2022-07-14 09:05:44', NULL),
(93, 7, 13, NULL, 'page', 'Signs and symptoms', '<p>The signs and symptoms of acne depend on the severity of the condition. Acne can be found almost anywhere on the body; however, breakouts are most noticeable on the face and neck, back, shoulders and chest. With acne you might experience:</p>\r\n<ul>\r\n<li>Rough and uneven skin tone (hyperpigmentation)</li>\r\n<li>Skin discoloration, dark patches, spots, and redness</li>\r\n<li>Scarring</li>\r\n<li>Swelling and inflammation</li>\r\n<li>Pain</li>\r\n<li>Tenderness</li>\r\n</ul>\r\n<p>Popping pimples raises the chances of scarring, therefore, avoid squeezing them no matter how tempted you are to. Once a pimple appears, it can take a few days to several weeks to clear up completely.</p>', NULL, NULL, 60, 1, '2022-07-02 07:31:10', '2022-07-14 09:05:44', NULL),
(94, 7, 13, NULL, 'page', 'Diagnosis', '<p>If you suspect that you may have acne, it is advisable to get a diagnosis from a certified dermatologist. The dermatologist will examine your skin and help identify the types of lesions. The type and severity of lesions will help develop a treatment plan that works best for you.</p>\r\n<p>Local symptoms of acne include pain, tenderness, and erythema. In rare cases, acne may present as highly inflamed cysts and abscesses with systemic symptoms including fever, joint pain and general malaise. Patients with preexisting medical conditions, such as polycystic ovarian syndrome (PCOS), generally present to dermatologists for acne.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>When to see a doctor</strong></p>\r\n<p>Some women experience acne flares a week before menstruation which generally clears up without treatment.&nbsp;</p>\r\n<p>If self-care remedies are insufficient to clear your acne, seek professional help. A dermatologist will be able to prescribe medications to treat acne. Also, the sudden onset of acne in older adults may also be a sign of an underlying disease that requires prompt medical attention.</p>', NULL, NULL, 70, 1, '2022-07-02 07:31:58', '2022-07-14 09:05:44', NULL),
(95, 7, 13, NULL, 'page', 'Treatment', '<p>Current treatment guidelines recommend a combination of topical retinoids and antibacterial therapy as the first line of treatment for most patients with acne. However, it is important to bear in mind that the grade and severity of acne will help determine appropriate treatment.</p>\r\n<p><strong>Topical treatments </strong></p>\r\n<p><strong>Retinoids </strong></p>\r\n<p>Topical retinoids are a class of chemical compounds that reduce the number of inflammatory lesions. Topical retinoids are the first line of therapy and should be continued as maintenance therapy to prevent acne formation. The most prescribed topical retinoids for acne are adapalene, tazarotene and tretinoin.</p>\r\n<p>Retinoids should be applied once a week at night ( for begginers) and then increased to 2 to 3 days a week if no irritation, skin peeling and redness is seen. Irritation due to retinoids can be countered with use of mild and nonirritating cleansers and moisturisers. Retinoids are associated with skin sensitivity and it is important to apply a sunscreen during the day.</p>\r\n<p>If irritation persists, the topical treatment can be used at alternate days. The retinoids are also known to be associated with skin sensitivity; therefore, it is important to use sun protection.</p>\r\n<p><strong>Topical antibiotics </strong></p>\r\n<p>Topical antibiotics have anti-inflammatory properties. Commonly prescribed topical antibiotics consist of clindamycin, erythromycin, dapsone and minocycline. Topical dapsone is a sulfone antibiotic with anti-inflammatory properties that has shown to be effective against mild-to-moderate acne. It is available in formulations that can be applied once a day.</p>\r\n<p>Over the counter benzoyl peroxide products are also effective for the treatment of acne. They are available in the form of gels, creams, lotions, washes, and soaps. These products can be used once or twice a day. In some cases, it may cause an allergic reaction especially if used in combination with tretinoin or aggressive washing methods.</p>\r\n<p>Before starting any treatment, do perform a patch test.&nbsp;</p>\r\n<p><strong>Oral antibiotics </strong></p>\r\n<p>Systemic antibiotics are the mainstay treatment for moderate-to-severe acne. The agents have anti-inflammatory properties and are effective against bacteria causing acne. The antibiotics commonly prescribed for acne are either a tetracycline (minocycline, doxycycline) or a macrolide (erythromycin, azithromycin).</p>\r\n<p><strong>Isotretinoin </strong></p>\r\n<p>Isotretinoin is a systemic retinoid used for the treatment of severe acne. It reduces oil production, promotes cell turnover, has anti-inflammatory and antibacterial properties. The medication helps reduce acne scarring and is specifically prescribed to individuals who have not had success with other medications.</p>\r\n<p><strong>Mild acne </strong></p>\r\n<p>For mild acne, over the counter (OTC) medicated spot treatment, creams, and cleansers are available to treat pimples as they first appear. Acne creams and gels are made of common ingredients including benzoyl peroxide and salicylic acid.</p>\r\n<ul>\r\n<li>Benzoyl peroxide: helps dry existing acne and prevents new ones from forming. This topical treatment also helps kill acne-causing bacteria.</li>\r\n<li>Salicylic acid: helps exfoliate the skin and prevents acne-causing bacteria from clogging pores.</li>\r\n</ul>\r\n<p><strong>Moderate acne </strong></p>\r\n<p>If the symptoms persist even after using over-the-counter medications for few weeks, it is recommended that you reach out to a professional for help. A healthcare professional or dermatologist (skin specialist) can prescribe medications that can help reduce the symptoms of acne, as well as prevent scarring. For moderate acne, the dermatologist generally prescribes benzoyl peroxide, antibiotics, erythromycin, clindamycin and retinoids, for example, retinol.</p>\r\n<p>In some cases, the dermatologist may also recommend oral antibiotics and hormonal birth control to help manage acne. Typically, antibiotics are prescribed for a short period, so that the body does not build any resistance against them and make you prone to infections.</p>\r\n<p><strong>Severe </strong></p>\r\n<p>A dermatologist may recommend oral antibiotics, benzoyl peroxide, topical retinoids, topical antibiotics or combine the medications for severe acne. In some cases, the dermatologist may also recommend oral isotretinoin which goes by the brand name Accutane or hormonal birth control. Accutane is a vitamin A medication used for the treatment of nodular acne. Doctors usually only prescribe it when other treatments do not work.</p>\r\n<p>Your dermatologist may further recommend medical procedures for the treatment of severe acne and for preventing scarring. The procedures work by reducing oil production and by removing damaged skin cells.</p>\r\n<ul>\r\n<li>Photodynamic therapy (PDT): In photodynamic therapy, the skin specialist uses medication and a special laser or light for reducing the production of oil and bacteria. Other laser treatments options are also avaible to address acne and related scarring.</li>\r\n<li>Dermabrasion: This is a type of exfoliation that removes the top layers of your skin with the help of a rotating brush. While the procedure is best recommended for the treatment of acne scarring, it is not for treating acne. Microdermabrasion is a milder form of treatment that helps remove dead skin cells.</li>\r\n<li>Chemical peel: These help remove the top layer of skin and reveal the less damaged skin underneath. The procedure is recommended for improving mild acne scarring.</li>\r\n</ul>\r\n<p>Cortisone injections: the injections help in reducing inflammation and improve healing. Cortisone is typically prescribed with other acne treatments, especially in cases that involve large cysts.</p>\r\n\r\n<p><strong>Home remedies for acne </strong></p>\r\n<p>While there are several acne home remedies, they dont always work, and some might even make acne worse. Instead of using toothpaste on your face, you can use these at-home remedies to reduce acne and prevent any future breakouts:</p>\r\n<ul>\r\n<li>Apply tea tree oil, aloe vera or a honey mask.</li>\r\n<li>Use green tea to refresh your face.</li>\r\n<li>Avoid touching your face as it can transfer bacteria from your hands.</li>\r\n<li>Never pick or squeeze pimples because it can cause bacteria and excess oil to spread and increase the risk of scarring.</li>\r\n</ul>\r\n<p><strong>Can you take acne medication during pregnancy? </strong></p>\r\n<p>There are severe consequences of many acne treatments, including Accutane for a developing fetus (an unborn baby). If you are pregnant or plan to become pregnant, ask your doctor whether you can continue taking it.</p>\r\n<p><strong>Are there any side effects to the treatments? </strong></p>\r\n<p>Oral antibiotics for acne are generally well-tolerated by most individuals, however, in some people, it may lead to side effects. for example: nausea, stomach upset, rashes, sensitivity to the sun and muscle aches. If you experience any of these side effects, stop taking the medications immediately and consult your doctor.</p>\r\n<p>Additionally, Isotretinoin causes dry skin, eyes and lips. While less common side effects include an upset stomach and muscle aches. Female patients should not take isotretinoin during pregnancy as it can lead to birth defects. Also, people living with depression and Crohns disease may also not be able to tolerate isotretinoin.</p>', NULL, NULL, 80, 1, '2022-07-02 07:34:48', '2022-07-14 09:05:44', NULL),
(96, 7, 13, NULL, 'page', 'Risk factors', '<p>There is currently no reliable data on why some people experience acne, whereas others dont. Studies have shown that there are several risk factors that can contribute to the worsening of acne. The risk factors are as follows:</p>\r\n<ul>\r\n<li>Hormonal changes caused by puberty or pregnancy</li>\r\n<li>Polycystic ovarian syndrome, and other endocrine conditions</li>\r\n<li>Family history of acne</li>\r\n<li>Use of certain medications, for example, steroids, anticonvulsants, hormonal birth control, and medications containing lithium.</li>\r\n<li>Comedogenic (tending to cause acne by blocking pores of the skin), cleansers, moisturizers, creams, and other skin products with high oil content.</li>\r\n<li>Stress</li>\r\n<li>Poor sleep</li>\r\n<li>Cigarette smoking</li>\r\n</ul>\r\n<p>There is a high risk of developing acne during puberty because the body is undergoing many hormonal changes. The changes can trigger the production of oil, and consequently increases the risk of acne. Hormonal acne because of puberty generally improves as we grow older, and the breakouts may even stop completely. Studies have further shown that certain foods or diets may also trigger acne:</p>\r\n<ul>\r\n<li>Foods low in glycemic index (a figure that represents the relative ability of food to increase the level of glucose in the blood): for example, processed meats and refined carbs help curb acne lesions.</li>\r\n<li>Milk products: for example, milk and ice cream, for some people have been shown to worsen acne. However, there is no data on non-milk dairy products, such as cheese worsening acne.</li>\r\n<li>Fat and fatty acids: omega 3 and omega-6 fatty acids are known to help reduce acne.</li>\r\n<li>Vegetarian and vegan diets: vegetarian and vegan diets offer plenty of health benefits, however, evidence is rare with respect to controlling or treating acne</li>\r\n</ul>\r\n<p>Probiotics: according to experts, probiotics found in supplements yoghurts and other fermented foods can help improve acne. However, there is no conclusive evidence on whether probiotics can be used for the treatment of acne.</p>', NULL, NULL, 90, 1, '2022-07-02 07:37:54', '2022-07-14 09:05:44', NULL),
