(107, 7, 11, NULL, 'page', 'Most children and adults with asthma have times when their breathing becomes more difficult.', '<p>Some people with severe asthma may have breathing problems most of the time.\r\n</p><p>\r\nThe most common symptoms of asthma are:\r\n</p><ul><li>\r\nwheezing (a whistling sound when breathing)\r\n</li><li>breathlessness\r\n</li><li>a tight chest  it may feel like a band is tightening around it\r\ncoughing\r\n</li></ul><p>Many things can cause these symptoms, but they\'re more likely to be asthma if they:\r\n</p><ul><li>\r\nhappen often and keep coming back\r\n</li><li>are worse at night and early in the morning\r\n</li><li>seem to happen in response to an asthma trigger like exercise or an allergy (such as to pollen or animal fur)\r\n</li><li>See a GP if you think you or your child may have asthma, or you have asthma and are finding it hard to control.\r\n\r\nAsthma attacks\r\nAsthma can sometimes get worse for a short time  this is known as an asthma attack. It can happen suddenly, or gradually over a few days.\r\n<br><br>Signs of a severe asthma attack include:\r\n<br>wheezing, coughing and chest tightness becoming severe and constant\r\n</li><li>being too breathless to eat, speak or sleep\r\n</li><li>breathing faster\r\n</li><li>a fast heartbeat\r\n</li><li>drowsiness, confusion, exhaustion or dizziness\r\n</li><li>blue lips or fingers\r\n</li><li>fainting\r\n<br></li></ul><p>Read about what to do during an asthma attack.</p>', NULL, NULL, 30, 1, '2022-07-04 04:15:52', '2022-07-04 04:16:20', NULL),
(108, 7, 11, NULL, 'page', 'The exact cause of asthma is unknown.', '<p>People with asthma have swollen (inflamed) and \"sensitive\" airways that become narrow and clogged with sticky mucus in response to certain triggers.\r\n\r\nGenetics, pollution and modern hygiene standards have been suggested as causes, but there\'s not currently enough evidence to know if any of these do cause asthma.</p><p><br></p><h3>Asthma triggers</h3><p>\r\n\r\nAsthma symptoms often occur in response to a trigger.</p><p>\r\n</p><p>\r\nCommon triggers include:<br></p><ul><li>infections like colds and flu\r\n</li><li>allergies  such as to pollen, dust mites, animal fur or feathers\r\n</li><li>smoke, fumes and pollution\r\n</li><li>medicines  particularly anti-inflammatory painkillers like ibuprofen and aspirin\r\n</li><li>emotions, including stress, or laughter\r\n</li><li>weather  such as sudden changes in temperature, cold air, wind, thunderstorms, heat and humidity</li><li>\r\nmould or damp\r\n</li><li>exercise\r\n</li></ul><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><span style=\"letter-spacing: 0.2px;\">Once you know your triggers, trying to avoid them may help control your asthma symptoms.</span><br></p>', NULL, NULL, 40, 1, '2022-07-04 04:17:20', '2022-07-04 04:37:02', NULL),
