INSERT INTO `reference_widgets` (`id`, `widget_id`, `reference_id`, `ad_window_id`, `reference_type`, `heading`, `description`, `redirect_url`, `json_param`, `sequence`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(112, 7, 13, NULL, 'article', '1. Changes the function of hormones, cells, and genes', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">When you dont eat for a while, several things happen in your body.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">For example, your body changes hormone levels to make stored body fat more accessible and initiates important cellular repair processes.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Here are some of the changes that occur in your body during fasting:</p><ul style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; list-style-image: url(&quot;data:image/svg+xml,%3Csvg width=\'10\' height=\'10\' xmlns=\'http://www.w3.org/2000/svg\'%3E%3Ccircle cx=\'5\' cy=\'5\' r=\'2.5\' fill=\'%23EC1C82\'/%3E%3C/svg%3E&quot;); color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; font-size: 18px; letter-spacing: normal;\"><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\"><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">Insulin levels.</span>&nbsp;Blood levels of&nbsp;<a href=\"https://www.healthline.com/health/type-2-diabetes/insulin\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">insulin</a>&nbsp;drop significantly, which facilitates fat burning (<hl-trusted-source source=\"PubMed Central\" rationale=\"Highly respected database from the National Institutes of Health\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://pubmed.ncbi.nlm.nih.gov/27062219\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">1<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>).</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\"><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">Human growth hormone (HGH) levels.</span>&nbsp;The blood levels of&nbsp;<a href=\"https://www.healthline.com/nutrition/11-ways-to-increase-hgh\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">human growth hormone (HGH)</a>&nbsp;may increase dramatically. Higher levels of this hormone facilitate fat burning and muscle gain, and have numerous other benefits (<hl-trusted-source source=\"American Journal of Clinical Nutrition\" rationale=\"Highly respected journal,Expert written journal,Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://academic.oup.com/ajcn/article/102/2/464/4564588\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">2<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>,&nbsp;<hl-trusted-source source=\"PubMed Central\" rationale=\"Highly respected database from the National Institutes of Health\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://pubmed.ncbi.nlm.nih.gov/23220077\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">3<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>,&nbsp;<a href=\"https://www.sciencedirect.com/science/article/pii/S1043276020300825\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">4</a>,&nbsp;<a href=\"https://jme.bioscientifica.com/view/journals/jme/52/1/R107.xml\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">5</a>).</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\"><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">Cellular repair.&nbsp;</span>The body induces important cellular repair processes, such as removing waste material from cells (<a href=\"https://www.sciencedirect.com/science/article/pii/S1568163718301478\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">6</a>).</li><li style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; line-height: 26px; margin-bottom: 8px;\"><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">Gene expression.</span>&nbsp;There are beneficial changes in several genes and molecules related to longevity and protection against disease (<a rel=\"noopener noreferrer\" href=\"https://www.annualreviews.org/doi/full/10.1146/annurev-nutr-071816-064634\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">7</a>).</li></ul><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Many of the benefits of intermittent fasting are related to these changes in hormones, the function of cells, and gene expression.</p>', NULL, NULL, 10, 1, '2022-07-04 07:23:14', '2022-07-04 07:31:51', NULL),
(113, 7, 13, NULL, 'article', '2. Can help you lose weight and visceral fat', '<p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Many of those who try intermittent fasting are doing it to lose weight (<hl-trusted-source source=\"Nature\" rationale=\"Highly respected journal,Expert written journal,Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://www.nature.com/articles/ijo2014214\" target=\"_blank\" rel=\"noopener noreferrer nofollow\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">8<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Generally speaking, intermittent fasting will make you eat fewer meals.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Unless you compensate by eating much more during the other meals, youll end up taking in&nbsp;<a href=\"https://www.healthline.com/nutrition/how-many-calories-per-day\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">fewer calories</a>.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Additionally, intermittent fasting enhances hormone function to facilitate weight loss.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">Lower insulin levels, higher HGH levels, and increased amounts of norepinephrine (noradrenaline) all increase the breakdown of body fat and facilitate its use for energy.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">For this reason, short-term fasting actually&nbsp;<span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; font-weight: bolder;\">increases</span>&nbsp;your metabolic rate, helping you burn even more calories (<a href=\"https://www.annualreviews.org/doi/full/10.1146/annurev-nutr-071816-064634\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">7</a>,&nbsp;<hl-trusted-source source=\"Nature\" rationale=\"Highly respected journal,Expert written journal,Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://www.nature.com/articles/s41598-018-36674-9\" target=\"_blank\" rel=\"noopener noreferrer nofollow\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">9<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">In other words, intermittent fasting works on both sides of the calorie equation. It boosts your metabolic rate (increases calories out) and reduces the amount of food you eat (reduces calories in).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">According to a 2014 review of the scientific literature, intermittent fasting can cause weight loss of 38% over 324 weeks. This is a huge amount (<a rel=\"noopener noreferrer\" href=\"http://www.sciencedirect.com/science/article/pii/S193152441400200X\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">10</a>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The study participants also lost 47% of their waist circumference over 624 weeks, which indicates that they lost lots of&nbsp;<a href=\"https://www.healthline.com/health/visceral-fat\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">visceral fat</a>. Visceral fat is the harmful fat in the abdominal cavity that causes disease (<a rel=\"noopener noreferrer\" href=\"http://www.sciencedirect.com/science/article/pii/S193152441400200X\" target=\"_blank\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">10</a>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">One 2011 review also showed that intermittent fasting caused less muscle loss than continuous calorie restriction (<hl-trusted-source source=\"Wiley\" rationale=\"Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://onlinelibrary.wiley.com/doi/full/10.1111/j.1467-789X.2011.00873.x\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">11<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">However, a 2020 randomized trial looked at people who followed the 16/8 method. In this diet, you fast for 16 hours a day and have an 8-hour window to eat.</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">The people who fasted didnt lose significantly more weight than the people who ate three meals a day. After testing a subset of the participants in person, the researchers also found that the people who fasted lost a significant amount of lean mass. This included lean muscle (<hl-trusted-source source=\"JAMA\" rationale=\"Highly respected journal,Expert written journal,Peer reviewed journal\" class=\"css-12hs4c5\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; display: inline;\"><a href=\"https://jamanetwork.com/journals/jamainternalmedicine/article-abstract/2771095\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">12<span class=\"css-1mdvjzu icon-hl-trusted-source-after\" style=\"box-sizing: inherit; cursor: pointer;\"><span class=\"sro\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; position: absolute; left: -10000px; top: auto; width: 1px; height: 1px; overflow: hidden;\">Trusted Source</span></span></a><span style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit;\"></span></hl-trusted-source>).</p><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; margin-bottom: 25px; margin-top: 25px; font-size: 18px; line-height: 26px; color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, &quot;Proxima Nova Fallback&quot;, sans-serif; letter-spacing: normal;\">More studies are needed on the effect of fasting on muscle loss. All things considered, intermittent fasting has the potential to be&nbsp;<a href=\"https://www.healthline.com/nutrition/intermittent-fasting-and-weight-loss\" class=\"content-link css-5r4717\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; cursor: pointer; border-color: currentcolor; color: rgb(2, 131, 141);\">an incredibly powerful weight loss tool</a>.</p>', NULL, NULL, 20, 1, '2022-07-04 07:31:08', '2022-07-04 07:32:26', NULL),
(114, 12, 1, NULL, 'page', NULL, NULL, NULL, NULL, 210, 0, '2022-07-04 08:13:21', '2022-07-13 01:38:16', NULL),
