(116, 2, 17, 2, 'page', 'Top Articles', '<p>Find the the best articles on selected topic</p>', NULL, NULL, 10, 1, '2022-07-04 09:19:28', '2022-07-14 11:19:15', NULL),
(117, 9, 17, NULL, 'page', NULL, NULL, NULL, NULL, 20, 1, '2022-07-04 09:22:38', '2022-07-14 11:19:15', NULL),
(118, 7, 14, 1, 'article', 'Concepts in mental health', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Throughout our lives, multiple individual, social and structural determinants may combine to protect or undermine our mental health and shift our position on the mental health continuum.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Individual psychological and biological factors such as emotional skills, substance use and genetics can make people more vulnerable to mental health problems.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Exposure to unfavourable social, economic, geopolitical and environmental circumstances  including poverty, violence, inequality and environmental deprivation  also increases peoples risk of experiencing mental health conditions.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Risks can manifest themselves at all stages of life, but those that occur during developmentally sensitive periods, especially early childhood, are particularly detrimental. For example, harsh parenting and physical punishment is known to undermine child health and bullying is a leading risk factor for mental health conditions.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Protective factors similarly occur throughout our lives and serve to strengthen resilience. They include our individual social and emotional skills and attributes as well as positive social interactions, quality education, decent work, safe neighbourhoods and community cohesion, among others.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Mental health risks and protective factors can be found in society at different scales. Local threats heighten risk for individuals, families and communities. Global threats heighten risk for whole populations and include economic downturns, disease outbreaks, humanitarian emergencies and forced displacement and the growing climate crisis.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Each single risk and protective factor has only limited predictive strength. Most people do not develop a mental health condition despite exposure to a risk factor and many people with no known risk factor still develop a mental health condition. Nonetheless, the interacting determinants of mental health serve to enhance or undermine mental health.</p>', NULL, NULL, 10, 1, '2022-07-04 09:23:36', '2022-07-04 09:32:42', NULL),
