(121, 7, 23, 1, 'page', 'What are Anxiety Disorders?', '<p><span style=\"color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 16px; letter-spacing: normal;\">Anxiety is a normal reaction to stress and can be beneficial in some situations. It can alert us to dangers and help us prepare and pay attention. Anxiety disorders differ from normal feelings of nervousness or anxiousness and involve excessive fear or anxiety. Anxiety disorders are the most common of mental disorders and affect nearly 30% of adults at some point in their lives. But anxiety disorders are treatable and a number of effective treatments are available. Treatment helps most people lead normal productive lives.</span><br></p>', NULL, NULL, 10, 1, '2022-07-04 09:50:10', '2022-07-04 09:51:58', NULL),
