(128, 7, 10, NULL, 'page', 'How Much Sleep Do We Really Need?', '<p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">Scientific research makes clear that sleep is essential at any age. Sleep powers the mind, restores the body, and fortifies virtually every system in the body. But how much sleep do we really need in order to get these benefits?</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\"><span class=\"trusted-wrap\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative; display: inline;\"><a class=\"add-trustee trusted\" href=\"https://pubmed.ncbi.nlm.nih.gov/29073412/\" data-reference-id=\"1\" target=\"_blank\" rel=\"noopener nofollow noindex\" data-source-id=\"40\" data-href=\"https://pubmed.ncbi.nlm.nih.gov/29073412/\" style=\"margin: 0px; padding: 0px 13px 0px 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206); position: relative; display: inline;\">National Sleep Foundation guidelines<sup style=\"font-size: 10px; display: inline-block; padding-left: 3px; padding-right: 3px; line-height: normal;\">1</sup></a></span>&nbsp;advise that healthy adults need between 7 and 9 hours of sleep per night. Babies, young children, and teens need even more sleep to enable their growth and development. People over 65 should also get 7 to 8 hours per night.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">Knowing the general recommendations for how much sleep you need is a first step. Then its important to reflect on your individual needs based on factors like your activity level and overall health. And finally, of course, its necessary to apply&nbsp;<a href=\"https://www.sleepfoundation.org/sleep-hygiene/healthy-sleep-tips\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206);\">healthy sleep tips</a>&nbsp;so that you can actually get the full nights sleep thats recommended.</p>', NULL, NULL, 10, 1, '2022-07-05 02:04:18', '2022-07-05 02:05:22', NULL),
(129, 7, 16, NULL, 'article', 'Scientific research', '<p>Scientific research makes clear that sleep is essential at any age. Sleep powers the mind, restores the body, and fortifies virtually every system in the body. But how much sleep do we really need in order to get these benefits?</p>\r\n<p><a href=\"https://pubmed.ncbi.nlm.nih.gov/29073412/\" target=\"_blank\" rel=\"noopener nofollow noindex\" data-reference-id=\"1\" data-source-id=\"40\" data-href=\"https://pubmed.ncbi.nlm.nih.gov/29073412/\">National Sleep Foundation guidelines<sup>1</sup></a>&nbsp;advise that healthy adults need between 7 and 9 hours of sleep per night. Babies, young children, and teens need even more sleep to enable their growth and development. People over 65 should also get 7 to 8 hours per night.</p>\r\n<p>Knowing the general recommendations for how much sleep you need is a first step. Then its important to reflect on your individual needs based on factors like your activity level and overall health. And finally, of course, its necessary to apply&nbsp;<a href=\"https://www.sleepfoundation.org/sleep-hygiene/healthy-sleep-tips\">healthy sleep tips</a>&nbsp;so that you can actually get the full nights sleep thats recommended.</p>', NULL, NULL, 30, 1, '2022-07-05 02:11:09', '2022-07-22 11:57:10', NULL),
(130, 7, 16, NULL, 'article', 'How Much Sleep Do You Need?', '<p>These guidelines serve as a rule-of-thumb for how much sleep children and adults need while acknowledging that the ideal amount of sleep can vary from person to person.</p>\r\n<p>For that reason, the guidelines list a range of hours for each age group. The recommendations also acknowledge that, for some people with unique circumstances, theres some wiggle room on either side of the range for acceptable, though still not optimal, amount of sleep.</p>\r\n<p>Deciding how much sleep&nbsp;<em>you&nbsp;</em>need means considering your overall health, daily activities, and typical sleep patterns. Some questions that you help assess your individual sleep needs include:</p>\r\n<ul>\r\n<li>Are you productive, healthy, and happy on seven hours of sleep? Or have you noticed that you require more hours of sleep to get into high gear?</li>\r\n<li>Do you have coexisting health issues? Are you at higher risk for any disease?</li>\r\n<li>Do you have a high level of daily energy expenditure? Do you frequently play sports or work in a labor-intensive job?</li>\r\n<li>Do your daily activities require alertness to do them safely? Do you drive every day and/or operate heavy machinery? Do you ever feel sleepy when doing these activities?</li>\r\n<li>Are you experiencing or do you have a history of&nbsp;<a href=\"https://www.sleepfoundation.org/sleep-disorders\">sleeping problems</a>?</li>\r\n<li>Do you depend on&nbsp;<a href=\"https://www.sleepfoundation.org/nutrition/caffeine-and-sleep\">caffeine</a>&nbsp;to get you through the day?</li>\r\n<li>When you have an open schedule, do you sleep more than you do on a typical workday?</li>\r\n</ul>\r\n<p>Start with the above-mentioned recommendations and then use your answers to these questions to home in on your optimal amount of sleep.</p>', NULL, NULL, 20, 1, '2022-07-05 02:11:25', '2022-07-22 11:57:10', NULL),
(131, 7, 16, NULL, 'article', NULL, NULL, NULL, NULL, 40, 0, '2022-07-05 02:12:15', '2022-07-22 11:57:10', NULL),
