</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Are you experiencing or do you have a history of&nbsp;<a href=\"https://www.sleepfoundation.org/sleep-disorders\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206);\">sleeping problems</a>?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Do you depend on&nbsp;<a href=\"https://www.sleepfoundation.org/nutrition/caffeine-and-sleep\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206);\">caffeine</a>&nbsp;to get you through the day?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">When you have an open schedule, do you sleep more than you do on a typical workday?</li></ul><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">Start with the above-mentioned recommendations and then use your answers to these questions to home in on your optimal amount of sleep.</p>', NULL, NULL, 10, 1, '2022-07-05 02:58:13', '2022-07-05 02:58:58', NULL),
(133, 7, 27, NULL, 'page', 'What Is Mental Health?', '<p><span style=\"color: rgb(0, 0, 0); font-family: Tahoma, Verdana, Segoe, sans-serif; letter-spacing: normal;\">Mental health includes our emotional, psychological, and social well-being. It affects how we think, feel, and act. It also helps determine how we handle stress, relate to others, and make choices. Mental health is important at every stage of life, from childhood and adolescence through adulthood.</span><br></p>', NULL, NULL, 20, 0, '2022-07-05 03:43:59', '2022-07-15 00:47:34', NULL),
(134, 7, 27, NULL, 'page', 'Early Warning Signs', '<p style=\"box-sizing: inherit; margin: 0.75em 0px; color: rgb(0, 0, 0); font-family: Tahoma, Verdana, Segoe, sans-serif; letter-spacing: normal;\">Not sure if you or someone you know is living with mental health problems? Experiencing one or more of the following feelings or behaviors can be an early warning sign of a problem:</p><ul style=\"box-sizing: inherit; margin: 10px 0px 1.5em 40px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Tahoma, Verdana, Segoe, sans-serif; font-size: 14px; letter-spacing: normal;\"><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Eating or sleeping too much or too little</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Pulling away from people and usual activities</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Having low or no energy</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Feeling numb or like nothing matters</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Having unexplained aches and pains</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Feeling helpless or hopeless</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Smoking, drinking, or using drugs more than usual</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Feeling unusually confused, forgetful, on edge, angry, upset, worried, or scared</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Yelling or fighting with family and friends</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Experiencing severe mood swings that cause problems in relationships</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Having persistent thoughts and memories you can\'t get out of your head</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Hearing voices or believing things that are not true</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Thinking of harming yourself or others</li><li style=\"box-sizing: inherit; list-style: inherit; margin-bottom: 0.5em;\">Inability to perform daily tasks like taking care of your kids or getting to work or school</li></ul>', NULL, NULL, 30, 1, '2022-07-05 03:45:04', '2022-07-15 00:48:53', NULL),
(135, 5, 20, NULL, 'page', 'Surgery', 'This is a long text for demonstration', NULL, NULL, 30, 1, '2022-07-05 03:51:48', '2022-07-06 05:28:53', NULL),
(136, 7, 28, NULL, 'page', 'Overview', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Consuming a healthy diet throughout the life-course helps to prevent malnutrition in all its forms as well as a range of noncommunicable diseases (NCDs) and conditions. However, increased production of processed foods, rapid urbanization and changing lifestyles have led to a shift in dietary patterns. People are now consuming more foods high in energy, fats, free sugars and salt/sodium, and many people do not eat enough fruit, vegetables and other dietary fibre such as whole grains.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">The exact make-up of a diversified, balanced and healthy diet will vary depending on individual characteristics (e.g. age, gender, lifestyle and degree of physical activity), cultural context, locally available foods and dietary customs. However, the basic principles of what constitutes a healthy diet remain the same.</p>', NULL, NULL, 10, 1, '2022-07-05 03:57:45', '2022-07-05 03:58:15', NULL);
INSERT INTO `reference_widgets` (`id`, `widget_id`, `reference_id`, `ad_window_id`, `reference_type`, `heading`, `description`, `redirect_url`, `json_param`, `sequence`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(137, 7, 28, NULL, 'page', 'Practical advice on maintaining a healthy diet', '<h3 style=\"font-family: Arial, Helvetica, sans-serif; line-height: 20px; letter-spacing: normal; font-weight: 700; font-stretch: normal; font-size: 18px; color: rgb(60, 66, 69);\">Fruit and vegetables</h3><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Eating at least 400&nbsp;g, or five portions, of fruit and vegetables per day reduces the risk of NCDs&nbsp;<em>(2)</em>&nbsp;and helps to ensure an adequate daily intake of dietary fibre.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Fruit and vegetable intake can be improved by:</p><ul style=\"width: 828.875px; padding-left: 20px; float: inherit; color: rgb(60, 66, 69); font-family: Arial, Helvetica, sans-serif; letter-spacing: normal;\"><li>always including vegetables in meals;</li><li>eating fresh fruit and raw vegetables as snacks;</li><li>eating fresh fruit and vegetables that are in season; and</li><li>eating a variety of fruit and vegetables.</li></ul><h3 style=\"font-family: Arial, Helvetica, sans-serif; line-height: 20px; letter-spacing: normal; font-weight: 700; font-stretch: normal; font-size: 18px; color: rgb(60, 66, 69);\">Fats</h3><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Reducing the amount of total fat intake to less than 30% of total energy intake helps to prevent unhealthy weight gain in the adult population&nbsp;<em>(1, 2, 3)</em>. Also, the risk of developing NCDs is lowered by:</p><ul style=\"width: 828.875px; padding-left: 20px; float: inherit; color: rgb(60, 66, 69); font-family: Arial, Helvetica, sans-serif; letter-spacing: normal;\"><li>reducing saturated fats to less than 10% of total energy intake;</li><li>reducing&nbsp;<em>trans</em>-fats to less than 1% of total energy intake; and</li><li>replacing both saturated fats and&nbsp;<em>trans-</em>fats with unsaturated fats&nbsp;<em>(2, 3)</em>&nbsp; in particular, with polyunsaturated fats.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Fat intake, especially saturated fat and industrially-produced&nbsp;<em>trans-</em>fat intake, can be reduced by:</p><ul style=\"width: 828.875px; padding-left: 20px; float: inherit; color: rgb(60, 66, 69); font-family: Arial, Helvetica, sans-serif; letter-spacing: normal;\"><li>steaming or boiling instead of frying when cooking;</li><li>replacing butter, lard and ghee with oils rich in polyunsaturated fats, such as soybean, canola (rapeseed), corn, safflower and sunflower oils;</li><li>eating reduced-fat dairy foods and lean meats, or trimming visible fat from meat; and</li><li>limiting the consumption of baked and fried foods, and pre-packaged snacks and foods (e.g. doughnuts, cakes, pies, cookies, biscuits and wafers) that contain industrially-produced&nbsp;<em>trans-</em>fats.</li></ul><h3 style=\"font-family: Arial, Helvetica, sans-serif; line-height: 20px; letter-spacing: normal; font-weight: 700; font-stretch: normal; font-size: 18px; color: rgb(60, 66, 69);\">Salt, sodium and potassium</h3><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Most people consume too much sodium through salt (corresponding to consuming an average of 912&nbsp;g of salt per day) and not enough potassium (less than 3.5&nbsp;g). High sodium intake and insufficient potassium intake contribute to high blood pressure, which in turn increases the risk of heart disease and stroke&nbsp;<em>(8, 11)</em>.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Reducing salt intake to the recommended level of less than 5 g per day could prevent 1.7&nbsp;million deaths each year&nbsp;<em>(12)</em>.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">People are often unaware of the amount of salt they consume. In many countries, most salt &nbsp;comes from processed foods (e.g. ready meals; processed meats such as bacon, ham and salami; cheese; and salty snacks) or from foods consumed frequently in large amounts (e.g. bread). Salt is also added to foods during cooking (e.g. bouillon, stock cubes, soy sauce and fish sauce) or at the point of consumption (e.g. table salt).</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Salt intake can be reduced by:</p><ul style=\"width: 828.875px; padding-left: 20px; float: inherit; color: rgb(60, 66, 69); font-family: Arial, Helvetica, sans-serif; letter-spacing: normal;\"><li>limiting the amount of salt and high-sodium condiments (e.g. soy sauce, fish sauce and bouillon) when cooking and preparing foods;</li><li>not having salt or high-sodium sauces on the table;</li><li>limiting the consumption of salty snacks; and</li><li>choosing products with lower sodium content.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Some food manufacturers are reformulating recipes to reduce the sodium content of their products, and people should be encouraged to check nutrition labels to see how much sodium is in a product before purchasing or consuming it.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Potassium can mitigate the negative effects of elevated sodium consumption on blood pressure. Intake of potassium can be increased by consuming fresh fruit and vegetables.</p><h3 style=\"font-family: Arial, Helvetica, sans-serif; line-height: 20px; letter-spacing: normal; font-weight: 700; font-stretch: normal; font-size: 18px; color: rgb(60, 66, 69);\">Sugars</h3><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">In both adults and children, the intake of free sugars should be reduced to less than 10% of total energy intake&nbsp;<em>(2, 7)</em>. &nbsp;A reduction to less than 5% of total energy intake would provide additional health benefits&nbsp;<em>(7)</em>.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Consuming free sugars increases the risk of dental caries (tooth decay). Excess calories from foods and drinks high in free sugars also contribute to unhealthy weight gain, which can lead to overweight and obesity. Recent evidence also shows that free sugars influence blood pressure and serum lipids, and suggests that a reduction in free sugars intake reduces risk factors for cardiovascular diseases&nbsp;<em>(13)</em>.</p><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; line-height: 24px; letter-spacing: normal; font-stretch: normal; color: rgb(60, 66, 69);\">Sugars intake can be reduced by:</p><ul style=\"width: 828.875px; padding-left: 20px; float: inherit; color: rgb(60, 66, 69); font-family: Arial, Helvetica, sans-serif; letter-spacing: normal;\"><li>limiting the consumption of foods and drinks containing high amounts of sugars, such as sugary snacks, candies and sugar-sweetened beverages (i.e. all types of beverages containing free sugars  these include carbonated or noncarbonated soft drinks, fruit or vegetable juices and drinks, liquid and powder concentrates, flavoured water, energy and sports drinks, readytodrink tea, readytodrink coffee and flavoured milk drinks); and</li><li>eating fresh fruit and raw vegetables as snacks instead of sugary snacks.</li></ul>', NULL, NULL, 20, 1, '2022-07-05 03:58:26', '2022-07-05 03:58:54', NULL),
(138, 7, 29, NULL, 'page', 'How Much Sleep Do You Need?', '<p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">These guidelines serve as a rule-of-thumb for how much sleep children and adults need while acknowledging that the ideal amount of sleep can vary from person to person.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">For that reason, the guidelines list a range of hours for each age group. The recommendations also acknowledge that, for some people with unique circumstances, theres some wiggle room on either side of the range for acceptable, though still not optimal, amount of sleep.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">Deciding how much sleep&nbsp;<i style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">you&nbsp;</i>need means considering your overall health, daily activities, and typical sleep patterns. Some questions that you help assess your individual sleep needs include:</p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; list-style: none; color: rgb(0, 0, 0); letter-spacing: normal;\"><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Are you productive, healthy, and happy on seven hours of sleep? Or have you noticed that you require more hours of sleep to get into high gear?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Do you have coexisting health issues? Are you at higher risk for any disease?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Do you have a high level of daily energy expenditure? Do you frequently play sports or work in a labor-intensive job?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Do your daily activities require alertness to do them safely? Do you drive every day and/or operate heavy machinery? Do you ever feel sleepy when doing these activities?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Are you experiencing or do you have a history of&nbsp;<a href=\"https://www.sleepfoundation.org/sleep-disorders\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206);\">sleeping problems</a>?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">Do you depend on&nbsp;<a href=\"https://www.sleepfoundation.org/nutrition/caffeine-and-sleep\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline; color: rgb(69, 89, 206);\">caffeine</a>&nbsp;to get you through the day?</li><li style=\"margin: 0px 0px 16px; padding: 0px 0px 0px 14px; border-width: 0px; border-style: initial; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 28px; font-family: inherit; vertical-align: baseline; position: relative; color: rgb(7, 7, 7); word-break: break-word;\">When you have an open schedule, do you sleep more than you do on a typical workday?</li></ul><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 28px; font-family: Poppins, sans-serif; vertical-align: baseline; color: rgb(7, 7, 7); letter-spacing: normal;\">Start with the above-mentioned recommendations and then use your answers to these questions to home in on your optimal amount of sleep.</p>', NULL, NULL, 10, 1, '2022-07-05 04:08:28', '2022-07-05 04:10:33', NULL),
