(140, 7, 17, NULL, 'page', 'What Are Some Benefits of Exercise?', '<p style=\"outline: 0px; margin: 1em 0px 1.5em; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\">Experts recommend that teens get 60 minutes or more of moderate to vigorous physical activity each day. Here are some reasons why:</p><ul class=\"kh_longline_list\" style=\"outline: 0px; margin: 1em 0px 1.5em; padding-left: 40px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 14px; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\"><li style=\"outline: 0px; margin: 0px 0px 1.5em; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: left; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; font-size: 1em !important; line-height: 1.5em !important;\"><strong style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Exercise benefits every part of the body, including the mind.</strong>&nbsp;Exercise improves brain health and learning. It can help people sleep better. When you exercise, your body makes chemicals that help you feel good. Exercise lowers your chances of depression and decreases feelings of anxiety. Plus, exercise can give you a real sense of accomplishment and pride at having achieved a goal  like mastering a new dance routine or beating an old time in the 100-meter dash.</li><li style=\"outline: 0px; margin: 0px 0px 1.5em; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: left; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; font-size: 1em !important; line-height: 1.5em !important;\"><strong style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Exercise helps people keep a healthy weight and lower their risk of some diseases</strong>. Exercising regularly can help prevent weight gain, type 2 diabetes, heart disease, and high blood pressure. Bone-strengthening exercise  like jumping, running, or lifting weights  can help keep bones strong.</li><li style=\"outline: 0px; margin: 0px 0px 1.5em; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: left; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; font-size: 1em !important; line-height: 1.5em !important;\"><strong style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Exercise can help a person age well.</strong>&nbsp;This may not seem important now, but your body will thank you later. Regular exercise improves quality of life&nbsp; the ability to enjoy things&nbsp; as you get older. It can improve brain health and reduce the chance of getting Alzheimers (a brain disease that causes memory loss). Exercising can help prevent falls and injuries from falls.</li></ul><p style=\"outline: 0px; margin: 1em 0px 1.5em; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\">Three parts of a balanced exercise routine include: aerobic exercise, strength training, and flexibility activities.</p>', NULL, NULL, 30, 0, '2022-07-05 04:58:32', '2022-07-14 11:20:20', NULL),
(141, 7, 17, NULL, 'page', 'How Can I Get Aerobic Exercise?', '<p style=\"outline: 0px; margin: 1em 0px 1.5em; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\">Like other muscles, the heart enjoys a good workout. Aerobic exercise is any type of exercise that gets the&nbsp;<a href=\"https://kidshealth.org/en/teens/heart.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">heart</a>&nbsp;pumping and gets you breathing harder. When you give your heart and lungs this kind of workout regularly, they get stronger and are better at getting oxygen (in the form of oxygen-carrying blood cells) to all parts of your body.</p><p style=\"outline: 0px; margin: 1em 0px 1.5em; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\">If you play team sports, you\'re probably getting at least 60 minutes or more of moderate to vigorous activity on practice days. Some team sports that give you a great aerobic workout are&nbsp;<a href=\"https://kidshealth.org/en/teens/safety-basketball.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">basketball</a>,&nbsp;<a href=\"https://kidshealth.org/en/teens/safety-soccer.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">soccer</a>,&nbsp;<a href=\"https://kidshealth.org/en/teens/safety-lacrosse.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">lacrosse</a>, hockey, and rowing.</p><p style=\"outline: 0px; margin: 1em 0px 1.5em; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Arial, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; color: rgb(0, 0, 0); letter-spacing: normal; font-variant-numeric: normal !important; font-variant-east-asian: normal !important; font-stretch: normal !important; line-height: 1.5em !important;\">But if you don\'t play team sports, don\'t worry  there are plenty of ways to get aerobic exercise. These include&nbsp;<a href=\"https://kidshealth.org/en/teens/bike-safety.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">biking</a>, running,&nbsp;<a href=\"https://kidshealth.org/en/teens/safety-swimming.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">swimming</a>, dancing, in-line skating,&nbsp;<a href=\"https://kidshealth.org/en/teens/safety-tennis.html\" style=\"outline: 0px; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 102, 204); background: rgb(255, 255, 255); line-height: 1.35em; text-decoration-line: underline;\">tennis</a>, cross-country skiing, hiking, and walking quickly.</p>', NULL, NULL, 50, 0, '2022-07-05 05:02:42', '2022-07-14 11:20:27', NULL),
