(145, 7, 16, NULL, 'page', 'WHAT IS WELLNESS?', '<p style=\"border: 0px; font-family: Montserrat; font-size: 15px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); letter-spacing: normal; margin-right: 0px !important; margin-bottom: 20px !important; margin-left: 0px !important;\">Wellness is a modern word with ancient roots. The key tenets of wellness as both preventive and holistic can be traced back to ancient civilizations from the East (India, China) to the West (Greece, Rome). In 19th-century Europe and the United States, a variety of intellectual, religious and medical movements developed in parallel with conventional medicine. With their focus on holistic and natural approaches, self-healing and preventive care, these movements have provided a firm foundation for wellness today. Wellness-focused and holistic modalities have gained more visibility since the 1960s/1970s under the writings and thought leadership of an informal network of US physicians and thinkers (such as Halbert Dunn, Jack Travis, Don Ardell, Bill Hettler, and others). As these have evolved, proliferated, and gone mainstream, they have informed the healthy-living, self-help, self-care, fitness, nutrition, diet and spiritual practices that have become a flourishing wellness movement in the 21st century.&nbsp;</p>', NULL, NULL, 20, 0, '2022-07-06 02:58:00', '2022-07-14 11:23:40', NULL),
