r-spacing: normal;\">We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.</p><h2 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 25px; letter-spacing: normal;\">Links to Other Sites</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: normal;\">Our Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over, and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: normal;\">Children\'s Privacy</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: normal;\">Our Services do not address anyone under the age of 13. We do not knowingly collect personal identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.</p><h2 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 25px; letter-spacing: normal;\">Changes to This Privacy Policy</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: normal;\">We may update our Privacy Policy from time to time. Thus, we advise you to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately, after they are posted on this page.</p><h2 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 25px; letter-spacing: normal;\">Contact Us</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: normal;\">If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us.</p>', NULL, NULL, 10, 1, '2022-07-07 07:19:09', '2022-07-22 12:04:38', NULL),
(149, 17, 1, NULL, 'page', 'What is Hypertension or High Blood Pressure?', '<p><span style=\"color: rgb(3, 3, 3); font-family: Roboto, Arial, sans-serif; letter-spacing: normal; white-space: pre-wrap; background-color: rgb(249, 249, 249);\">Is video mein Dr. Syed Abdul Bari baat kareingai What is Hypertension or High Blood Pressure? yaani Hypertension Kia Hai?</span><br></p>', NULL, NULL, 130, 0, '2022-07-07 08:02:31', '2022-07-13 01:38:16', NULL),
(150, 17, 2, NULL, 'article', 'Dengue Fever - Dengue Mosquito - Dengue Fever Symptoms - Dengue Bukhar Ka Ilaj - Dengue Ki Alamat', '<p><span style=\"color: rgb(3, 3, 3); font-family: Roboto, Arial, sans-serif; letter-spacing: normal; white-space: pre-wrap; background-color: rgb(249, 249, 249);\">Barish kay season k bad Dengue Fever phail aha hai or har saal ki tarha Barish k mausam k bad Macharo ki afzaish huty hai or isk bad mosquito-born bemaria Phelty hai jaisy Malaria or dengue Khas tor pai kabil-e-ziker hai, Dr Khalid Mehmood Bata rahay hai dengue fever, dengue mosquito, dengue bukhar ki alamat (dengue symptoms) in Urdu &amp; history of dengue Fever kai baray main. </span><br></p>', NULL, NULL, 30, 1, '2022-07-07 11:08:20', '2022-07-30 11:36:58', NULL),
(151, 17, 1, NULL, 'page', 'Important Tips for Diabetes Patients', '<p>Is video mein Prof. Jamal Ara baat kareingi Important Tips for Diabetes Patient? yaani Diabtes kai mareezo kai liey ahem mashwaray?</p><p>Diabetes healthy eating tips are general and can help you manage your blood glucose, blood pressure and cholesterol levels. They can also help you manage your weight and reduce the risk of diabetes complications, such as heart problems and strokes, and other health conditions including certain types of cancers.</p>', 'https://www.google.com/', NULL, 120, 0, '2022-07-13 01:34:20', '2022-07-22 08:50:41', NULL),
