(165, 2, 9, NULL, 'article', 'How Much Sleep Do You Need?', '<p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; letter-spacing: normal;\"><b>ext messaging</b>, or&nbsp;<b>texting</b>, is the act of composing and sending electronic messages, typically consisting of alphabetic and numeric characters, between two or more users of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Mobile_device\" title=\"Mobile device\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">mobile devices</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Desktop_computer\" title=\"Desktop computer\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">desktops</a>/<a href=\"https://en.wikipedia.org/wiki/Laptop\" title=\"Laptop\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">laptops</a>, or another type of compatible computer. Text messages may be sent over a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cellular_network\" title=\"Cellular network\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">cellular network</a>, or may also be sent via an&nbsp;<a href=\"https://en.wikipedia.org/wiki/Internet\" title=\"Internet\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Internet</a>&nbsp;connection.</p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; letter-spacing: normal;\">The term originally referred to messages sent using the&nbsp;<a href=\"https://en.wikipedia.org/wiki/SMS\" title=\"SMS\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Short Message Service</a>&nbsp;(SMS). It has grown beyond alphanumeric text to include multimedia messages using the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Multimedia_Messaging_Service\" title=\"Multimedia Messaging Service\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Multimedia Messaging Service</a>&nbsp;(MMS) containing digital images, videos, and sound content, as well as ideograms known as&nbsp;<a href=\"https://en.wikipedia.org/wiki/Emoji\" title=\"Emoji\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">emoji</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Smiley\" title=\"Smiley\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">happy faces</a>, sad faces, and other icons), and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Instant_messenger\" class=\"mw-redirect\" title=\"Instant messenger\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">instant messenger</a>&nbsp;applications (usually the term is used when on mobile devices).</p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; letter-spacing: normal;\">Text messages are used for personal, family, business and social purposes. Governmental and non-governmental organizations use text messaging for communication between colleagues. In the 2010s, the sending of short informal messages became an accepted part of many cultures, as happened earlier with&nbsp;<a href=\"https://en.wikipedia.org/wiki/Email\" title=\"Email\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">emailing</a>.<sup id=\"cite_ref-1\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Text_messaging#cite_note-1\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[1]</a></sup>&nbsp;This makes texting a quick and easy way to communicate with friends, family and colleagues, including in contexts where a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Telephone_call\" title=\"Telephone call\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">call</a>&nbsp;would be impolite or inappropriate (e.g., calling very late at night or when one knows the other person is busy with family or work activities). Like e-mail and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Voicemail\" title=\"Voicemail\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">voicemail</a>&nbsp;and unlike calls (in which the caller hopes to speak directly with the recipient), texting does not require the caller and recipient to both be free at the same moment; this permits communication even between busy individuals. Text messages can also be used to interact with automated systems, for example, to order products or services from&nbsp;<a href=\"https://en.wikipedia.org/wiki/E-commerce\" title=\"E-commerce\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">e-commerce</a>&nbsp;websites, or to participate in online contests. Advertisers and service providers use&nbsp;<a href=\"https://en.wikipedia.org/wiki/Direct_Text_Marketing\" class=\"mw-redirect\" title=\"Direct Text Marketing\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">direct text marketing</a>&nbsp;to send messages to mobile users about promotions, payment due dates, and other notifications instead of using&nbsp;<a href=\"https://en.wikipedia.org/wiki/Mail\" title=\"Mail\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">postal mail</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Email\" title=\"Email\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">email</a>, or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Voicemail\" title=\"Voicemail\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">voicemail</a>.</p>', NULL, NULL, 30, 1, '2022-07-15 01:26:22', '2022-08-02 06:55:29', '2022-08-02 06:55:29'),
