(179, 8, 33, 2, 'page', 'Signal Processing and AI Technologies', '<p>The video stream is analyzed with advanced AI and deep learning algorithms, including computer vision technology and signal processing. No identifiable features or demographic data (e.g., eyes, height, gender, weight, etc.) are needed. In approximately one minute, users can measure blood pressure, heart rate, heart rate variability (SDNN and/or RRi raw data), oxygen saturation, respiration rate, sympathetic stress, parasympathetic activity and pulse-respiration quotient. Meri Sehats technology runs on the device, enabling users to perform scans without connection to the internet. (Please note, when offline, results will not be recorded in measurement history.)<br></p>', '/start-vital-scan', NULL, 50, 1, '2022-07-21 08:33:09', '2022-07-28 10:02:44', NULL),
