ation of the commitment length in your contract, which may differ from your billing frequency. In case of a dispute, we will revert back to you within 12-15 working days with the update on the situation.&nbsp;</span></p><p><span id=\"docs-internal-guid-df68ce66-7fff-d4f6-02cf-da7b0c102b30\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Paid Subscription cannot be refunded and Meri Sehat is not liable to refund any paid subscription.</span></p>', NULL, NULL, 10, 1, '2022-07-25 09:13:03', '2022-07-25 09:14:11', NULL),
