INSERT INTO `site_content` (`id`, `translation_of`, `lang_id`, `heading`, `title`, `keyword`, `meta_description`, `slug`, `content`, `status`, `edit_by`, `created_at`, `updated_at`) VALUES
(1, NULL, 1, 'Privacy Policy', 'Privacy Policy', 'privacy-policy', 'Privacy Policy', 'privacy-policy', '<div id=\"lipsum\" style=\"margin: 0px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; letter-spacing: normal;\"><h2 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: DauphinPlain; font-size: 24px; line-height: 24px; text-align: left; color: rgb(0, 0, 0);\"><p style=\"color: rgb(70, 72, 85); font-family: Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">Today\'s business world is largely dependent on data and the information that is derived from that data.</p><p style=\"color: rgb(70, 72, 85); font-family: Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">Data is critical for businesses that process that information to provide services and products to their customers. From a corporate context, in a company - from the top executive level right down to the operational level - just about everyone relies heavily on information.</p><p style=\"color: rgb(70, 72, 85); font-family: Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">In a complex environment where so much depends on the data that businesses collect and process, protecting that information becomes increasingly important. Among the steps business owners take to protect the data of their users, drafting a&nbsp;<span style=\"font-weight: bolder;\">clear and concise Privacy Policy</span>&nbsp;agreement holds central importance.</p><p style=\"color: rgb(70, 72, 85); font-family: Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: normal;\">In this article, we will discuss the elements of a Privacy Policy to help you better understand the constructs of an effective Privacy Policy agreement that instills faith and trust in your customers and protects you from a number of liability issues.</p></h2><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px;\"><br></p><div><br></div></div>', 1, 1, '2022-06-15 05:20:49', '2022-07-04 06:29:57'),
(2, NULL, 1, 'asd', 'asd', 'asd', 'asd', 'asd', '<p>asdasd asdasd</p>', 0, 1, '2022-06-23 01:55:33', '2022-06-23 01:56:11'),
(3, NULL, 1, 'asasas', 'jhashAZHA', 'asxasxas', 'asxasxasasxs', 'asasxas', '<p>xasaxax</p>', 0, 1, '2022-06-23 01:55:46', '2022-06-23 01:56:20'),
(4, NULL, 1, 'Privacy Heading', 'Privacy Title', 'Privacy Keyword', 'Privacy Meta Description', 'Privacy Slug', '<p><span style=\"color: rgb(77, 81, 86); font-family: arial, sans-serif; letter-spacing: normal;\">Content is the information contained within communication media. This includes internet, cinema, television, radio, audio CDs, books, magazines, physical art, and live event content. Its directed at an end-user or audience in the sectors of publishing, art, and communication</span><br></p>', 0, 1, '2022-06-23 02:47:27', '2022-07-04 01:15:01'),
